INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (1, 'Джена', 'Мэлоун', 'Джена Мэлоун (Jena Malone) – американская актриса, еще до достижения 16 лет удостоившаяся номинации на «Золотой глобус» за работу в картине «Надежда» и на премию Гильдии актеров за главную роль в фильме «Ублюдок из Каролины», получившая премию «Сатурн» как лучшая актриса (фильм «Контакт»).', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (2, 'Дэнни', 'Хьюстон', 'Дэнни Хьюстон (Danny Huston) — американский актер и режиссер. Наибольшую известность обрел благодаря ролям в фильмах «Люди Икс: Начало. Росомаха», «Преданный садовник», «Роковое число 23», «21 грамм» и «Покидая Лас-Вегас».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (3, 'Софья', 'Присс', NULL, NULL);
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (4, 'Сергей', 'Бурунов', 'Сергей Бурунов – российский актер театра и кино, актер озвучивания и пародист. Получил известность по телешоу «Большая разница», после чего начал активно сниматься на телевидении и на большом экране. Бурунов снялся в таких сериалах, как «Краткий курс счастливой жизни», «Кухня» и «Полицейский с Рублевки», дилогии «Последний богатырь» и картине «Глубже!» (2020). Востребованный актер дубляжа - его голосом на русском языке «говорят» такие актеры, как Леонардо ДиКаприо, Джонни Депп, Джонатан Риз Майерс, Мэтт Дэймон и другие голливудские звезды.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (5, 'Виталий', 'Шляппо', 'Виталий Шляппо - белорусский сценарист и продюсер множества популярных отечественных развлекательных передач и сериалов, известный широкой зрительской аудитории, в первую очередь, как капитан команды КВН БГУ, дважды выигравшей в финале Высшей Лиги.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (6, 'Фёдор', 'Бондарчук', 'Фёдор Бондарчук – актер, режиссер, продюсер, клипмейкер, телеведущий. Обладатель премий «Золотой орел», «Ника», «Золотой овен».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (7, 'Константин', 'Хабенский', 'Константин Юрьевич Хабенский – российский актёр кино и театра, заслуженный артист России. Родился Константин Хабенский в Ленинграде в 1972 году, 11 января. Его отец был инженером-гидрологом, а мать работала учителем математики. В 1981 семья Хабенских переехала в Нижневартовск, а уже в 1985 году вернулась в Ленинград. Закончив 8 классов, Хабенский поступает в техникум авиационного приборостроения и автоматики. После 3 курса он бросает техникум, осознавая, что данная специальность не для него. Перед тем как найти свое призвание, Константин работал дворником, музыкантом на улицах, а также монтировщиком.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (8, 'Ханс', 'Циммер', 'Ханс Циммер (Hans Zimmer) – композитор, автор музыки к популярным фильмам («Темный рыцарь», «Ангелы и Демоны», «Код да Винчи» и др.). Лауреат премии «Оскар» и «Золотого глобуса» за лучший оригинальный саундтрек («Король Лев», 1994), второй «Золотой глобус» Циммер получил за музыку к фильму «Гладиатор» (2010). Композитор также многократно номинирован на «Оскар» за композиции к лентам «Человек дождя», «Жена священника», «Лучше не бывает», «Тонкая красная линия», «Принц Египта», «Шерлок Холмс», «Начало». В 2010-ом удостоен именной звезды на Голливудской Аллее Славы.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (9, 'Александр', 'Загоскин', NULL, NULL);
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (10, 'Гоша', 'Куценко', ' Юрий Георгиевич Куценко более известен как Гоша Куценко. Российский певец и актёр появился на свет 20 мая 1967 года в красивом украинском городке Запорожье. Вскоре он вместе с родителями переехал во Львов. Здесь актёр окончил школу №56, а позднее поступил в институт, но вскоре был призван в армию.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (11, 'Брюс', 'Уиллис', 'Брюс Уиллис (Bruce Willis) — знаменитый американский актёр, ранее считавшийся одним из самых высокооплачиваемых в Голливуде. Уиллис является обладателем кинопремии «Золотой глобус» и телепремии «Эмми», а также удостоен звезды на голливудской «Аллее славы». Известен как разножанровый актёр, на счету которого десятки культовых проектов, вроде таких, как «Крепкий орешек», «Криминальное чтиво», «12 обезьян», «Пятый элемент», «Шакал», «Армагеддон», «Шестое чувство», «Девять ярдов», «Неуязвимый», «Слёзы солнца», «Альфа Дог», «Город грехов», «Счастливое число Слевина», «16 кварталов», «Планета страха», «Суррогаты», «Неудержимые», «РЭД», «Петля времени», «Стекло», «Сиротский Бруклин».', ' 
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (12, 'Андрей', 'Мерзликин', 'Андрей Мерзликин – популярный российский актер театра и кино, получивший известность после исполнения роли Ошпаренного в фильме «Бумер». Снимался в таких лентах, как «Обитаемый остров», «Брестская крепость», «Франц+Полина», «Дом на обочине».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (13, 'Брэд', 'Питт', 'Брэд Питт (Brad Pitt) — американский актер и продюсер. Двукратный обладатель премии «Оскар» как продюсер фильма «12 лет рабства» и как исполнитель лучшей мужской роли второго плана в картине «Однажды в Голливуде». Один из самых популярных актеров своего поколения, Питт известен по огромному количеству фильмов, среди которых «Интервью с вампиром», «Семь», «Бойцовский клуб», «Большой куш», трилогия «друзей Оушена», «Знакомьтесь, Джо Блэк», «Загадочная история Бенджамина Баттона», «Человек, который изменил всё».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (14, 'Сет', 'Роген', 'Сет Роген (англ. Seth Rogen) — канадский актер, комик и сценарист. Наибольшую известность получил за свои роли в фильмах «Жизнь прекрасна» и «SuperПерцы».', '
