INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (24, 'Вигго', 'Мортенсен', 'Вигго Мортенсен (Viggo Mortensen) — американский актер датского происхождения. Наиболее известен по ролям в фильмах «Властелин колец», «Порок на экспорт», «Идеальное убийство» и «Идальго: Погоня в пустыне». Номинант на премию «Оскар» за роль в фильме «Капитан Фантанстик».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (25, 'Махершала', 'Али', 'Махершалалхашбаз (Махершала) Али Mahershalalhashbaz Ali) – американский актёр. Наиболее известен по ролям в сериалах «Карточный домик», «Люк Кейдж», а также фильму Барри Дженкинса «Лунный свет», за роль в котором он получил несколько наград и номинаций на «Золотой глобус».', '
