INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (30, 'Лесли', 'Бибб', 'Лесли Бибб – американская актриса, модель. Известна по ролям в таких успешных фильмах, как «Законопослушный гражданин», «Шопоголик», «Полуночный экспресс», «Железный человек».', '
