INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (33, 'Ким', 'Кэтролл', 'Ким Кэтролл (Kim Cattrall) – знаменитая британская актриса, снимающаяся в Голливуде. Звезда популярного телесериала «Секс в большом городе», где она исполнила роль соблазнительной и ненасытной блондинки Саманты Джонс. Также Ким известна по фильмам «Полицейская академия», «Манекен», «Награда». Обладательница «Эмми» и «Золотого глобуса».', '
