INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (44, 'Сергей', 'Чонишвили', 'Сергей Чонишвили – популярный советский и российский актёр театра и кино, заслуженный артист России. Родился в городе Тула 3 августа 1965 года в семье актёров.', 'Несмотря на творческую профессию своих родителей, он долгое время мечтал стать океанологом, правда, ближе к моменту окончания школы всё же решил попробовать поступить в театральный ВУЗ. Сергей совершенно не ожидал, что в прославленное Театральное училище имени Щукина его примут с первой попытки, но в конечном итоге он смог освоиться в новой для себя среде и в 1986 году окончил училище с красным дипломом.Начинающего актёра сразу же приняли в труппу театра «Ленком». Поначалу он играл в спектаклях «Юнона и Авось», «Жестокие игры», «Звезда и смерть Хоакина Мурьеты», нередко участвовал в массовке, но в начале девяностых количество предложений резко сократилось. В этот период Чонишвили время от времени играл на сценах антрепризы Андрея Житинкина, Театра-студии Олега Табакова.Поначалу и отношения с кинематографом у актёра не складывались, в восьмидесятые он успел сняться только в двух эпизодах, которые не принесли ему ни удовлетворения, ни известности. В девяностые ситуация несколько изменилась – на него обратили своё внимание начинающие режиссёры, в тот период он сыграл Табакина в картине «Дезертир», Юрку – в фильме «Катька и Шиз», Мишу – в «Психе и мелочёвке» и других.В новом веке Сергей Чонишвили стал по-настоящему известным и востребованным. Во многом это произошло благодаря роли князя Владимира Шадурского в многосерийном фильме «Петербургские тайны», который снимали в течение полутора лет. Актёру удалось создать очень сложный многогранный образ, который, несмотря на большое количество серий, не примелькался и не надоел зрителю.На данный момент в послужном списке Сергея Ножериевича около шестидесяти картин, но не все знают, что, помимо съёмок, он занимается и озвучиванием. В этом деле он оказался весьма востребованным, несмотря на то, что поначалу артисту долгое время приходилось избавляться от своего сибирского говора.');
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (45, 'Владимир', 'Еремин', 'Владимир Аркадьевич Ерёмин – российский актёр и сценарист. Родился в Омской области в посёлке Муромцево 6 сентября 1950 года. Его родители не были людьми искусства: отец трудился на оборонном комплексе, а мама работала учителем. Помимо Владимира, Ерёмины воспитывали ещё двоих сыновей.', 'В детстве у Владимира были две страсти – чтение и цирк. Книги были с ним практически везде: в школе, на улице, в транспорте. А после того, как он попал на первое в своей жизни цирковое представление, забыть об этом он уже не мог – настолько это были сильные впечатления. Владимир даже пытался поехать в Свердловск, чтобы поступить в цирковую школу, но его сняли с поезда и доставили домой.Увлечение театром началось позднее, в более зрелом возрасте. А в 1972 году Ерёмин уже был выпускником Школы-Студии МХАТ, сразу после окончания которой начал работать в Русском театре драмы им. Михаила Лермонтова в городе Алма-Ата. Позднее он был актёром труппы ленинградского театра Комедии им. Акимова, а ещё через три года начал играть на сцене Ленинградского большого драматического театра имени Горького.Активно сниматься в кино актёр начал в восьмидесятые, но и сегодня он продолжает радовать зрителей новыми работами. Самыми известными картинами с его участием считаются «Таможня», «Преферанс по пятницам», «Сон в руку, или Чемодан», «Криминальный квартет», «Что сказал покойник», «Каменская» и некоторые другие.Помимо съёмок, Владимир Ерёмин занимается озвучиванием фильмов. Так, в русскоязычной версии нашумевшего фильма «Парфюмер: история одного убийцы» голос Джузеппе Бальдини принадлежит именно Владимиру. А в далёком 1989 году главный отрицательный персонаж Джокер в «Бэтмене» также говорил его голосом.По сценариям, написанным Владимиром Ерёминым, были сняты такие картины, как «Любовь предвестие печали», одна из серий «Маросейка, 12», «Хочу в тюрьму», «Есть идея».Также актёр в своё время вёл телепередачу «Алфавит», которая стала популярной во многом благодаря его доброжелательности и интеллигентности, умению вести диалог.');
