INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (51, 'Егор', 'Корешков', 'Егор Корешков – российский актер театра и кино широкого творческого диапазона, получивший известность после выхода телесериалов «Восьмидесятые» (2011-2016), «Психологини» (2017-2019), «257 причин, чтобы жить» (2020) и комедии «Горько!» (2013).', '
