INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (54, 'Фрэнк', 'Дарабонт', 'Фрэнк Дарабонт (Frank Darabont) – знаменитый голливудский режиссер, сценарист и продюсер. Автор одних из самых популярных шедевров кино всех времен – фильмов «Побег из Шоушенка» и «Зеленая миля», за которые был номинирован на «Оскар». Создатель культового сериала «Ходячие мертвецы».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (55, 'Том', 'Хэнкс', 'Томас Джеффри Хэнкс (Thomas Jeffrey Hanks) – выдающийся американский актер, режиссер, сценарист и продюсер. За свою карьеру в кино, насчитывающую пять десятилетий, Хэнкс снялся в огромном количестве фильмов, среди которых особенно известны его работы в картинах «Филадельфия» (1993) и «Форрест Гамп» (1994), принесшие две премии «Оскар» подряд. Столь же успешными получились роли Хэкнса в фильмах «Зеленая миля» (1999) «Изгой» (2000), «Терминал» (2004) и многих других.', ' 
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (56, 'Дэвид', 'Морс', 'Дэвид Баудич Морс – американский актер, получивший известность благодаря медицинской драме «Сент-Элсвер», фильму Ларса фон Триера «Танцующая в темноте», драме Шона Пенна «Бегущий индеец», остросюжетному боевику Феликса Гэри Грея «Переговорщик», фантастическому фильму Роберта Земекиса «Контакт», культовой мистической драме Фрэнка Дарабонта «Зеленая миля», молодежному триллеру Ди-Джея Карузо «Паранойя», боевику Ренни Харлина «Долгий поцелуй на ночь», драме Шона Пенна «Постовой на перекрестке», триллеру Майкла Бэйя «Скала», детективу Майкла Эптида «Крайние меры», фантастической ленте Терри Гиллиама «12 обезьян», фильму Ричарда Доннера «16 кварталов», а также музыкальной драме Деборы Кампмейер «Затравленная».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (57, 'Майкл', 'Кларк', 'Через тернии к звездам, несмотря и вопреки! В двух словах такова история жизни Майкла Кларка Дункана – человека, которого сложно было не заметить. Настоящий Большой Майк с большим сердцем.', '
