INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (61, 'Грэм', 'Грин', 'Грэм Грин - один из самых популярных канадских актеров, сыгравший в более чем ста кино и телепроектах, мировую известность которому принесла оскароносная кинолента «Танцующий с волками» и другие фильмы, среди которых нашумевшие картины «Дикая земля», «Саботаж», «Крепкий орешек 3: Возмездие», «Резервация», «Зеленая миля», «Снежные псы», «Друзья-бегуны», «Несносный мальчишка» и «Погоня за Шекспиром».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (62, 'Даг', 'Хатчисон', NULL, NULL);
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (63, 'Сэм', 'Рокуэлл', 'Продолжатель актерской династии, воспитанный отцом и абсолютно равнодушный в отношении создания собственной семьи. Не любит давать интервью, театр предпочитает кино, он просто идиосинкратичен и ироничен. Сэм Рокуэлл – эксцентричный и независимый.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (64, 'Барри', 'Пеппер', 'Барри Пеппер – актер американского кино и телевидения, известный широкой зрительской аудитории по ролям в популярных фильмах: «Спасти рядового Райана» Стивена Спилберга, «Семь жизней» Габриэле Муччино, «25-й час» Спайка Ли, «Железная хватка» братьев Коэнов и «Зеленая миля» Фрэнка Дарабонта.', '
