INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (68, 'Борис', 'Каморзин', 'Борис Каморзин – российский актер театра и кино. Известен по ролям в фильмах и сериалах «Долгое прощание» Сергея Урсуляка, «Сказка про темноту» Николая Хомерики, «Громозека» Владимира Котта, «Хмуров» Сергея Коротаева.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (69, 'Роман', 'Мадянов', 'Роман Мадянов - российский актер театра и кино, заслуженный артист России. Родился в Московской области в Дедовске 22 июля 1962 года.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (70, 'Никита', 'Тарасов', 'Никита Тарасов – российский актер театра и кино, наиболее известный по роли повара Луи из сериала «Кухня» и разочарованного женой супруга из комедии «Интимные места».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (71, 'Сергей', 'Барковский', 'Сергей Барковский – российский актёр театра и кино, лауреат многих театральных премий. Широкому зрителю Барковский известен по своим ролям в телесериалах.', 'Родился 14 декабря 1963 года в Алма-Ате. С трёх лет жил в городе Николаев (Украина), там же он учился в обычной средней школе. После получения среднего образования Сергей Барковский уехал в Ленинград, где поступил на философский факультет (отделение научного коммунизма) в Ленинградский государственный университет. Окончив высшее учебное заведение с отличием, он планировал поступление в аспирантуру, работал преподавателем философии в ЛВИМУ имени Макарова.Тем не менее, параллельно с преподавательской деятельностью Сергей Барковский занимался в полупрофессиональной театральной студии при театре Комедии. Вскоре Сергей поступил в ЛГИТМиК, который окончил в 1992 году с двумя красными дипломами – актёрским и режиссёрским.После учёбы Сергей Барковский был принят в труппу Молодёжного театра на Фонтанке. Вскоре он со своими друзьями сочинил и поставил детский спектакль «Калиф-аист» по мотивам восточных сказок. А в 1996 году данная работа была представлена на международном фестивале детских спектаклей «Банановая Рыба» в Таллине. И Сергей Барковский, сыгравший главную роль, получил свою первую театральную премию.За время работы в Молодёжном театре актёр принял участие в десятках постановок, самыми значительными из которых считаются «Три сестры», «Двенадцатая ночь», «Стакан воды», «Дни Турбиных», «Касатка». Игра в последнем принесла Сергею Барковскому целый ряд театральных наград. Также актёр удостоился престижных премий за такие постановки, как «Я должен убрать президента» (2001 год), «Жаворонок» (2002), «История села Горюхина» (2003, 2006), «Авдей Флюгарин» (2005), «Шутники» (2006).Параллельно с работой в театре Сергей Барковский снимался в кино. Но ему в основном доставались однотипные роли в телевизионных сериалах. Самыми известными его работами в кинематографе признаны роли в лентах «Бандитский Петербург», «Ниро Вульф и Арчи Гудвин», «Улицы разбитых фонарей», «Три цвета любви» и «Брежнев».');
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (72, 'Михаил', 'Крылов', 'Михаил Крылов - российский актер театра и кино, известный по фильмам «Мама», «Гитлер капут!», «Я буду рядом», «Афроiдиты», «Дублер», «Что творят мужчины!», сериалам «Штрафбат», «Есенин», «Котовский», «Завещание Ленина» и другим лентам.', '
