INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (77, 'Ким', 'Бейсингер', 'Ким Бейсингер (Kim Basinger) – американская актриса. Обладательница премий «Оскар» и «Золотой глобус». Наибольшую известность приобрела благодаря ролям в фильмах «Секреты Лос-Анджелеса», «Бэтмен», «8 миля», «Привычка жениться» и «9 1/2 недель».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (78, 'Бриттани', 'Мерфи', 'Бриттани Мерфи (англ. Brittany Murphy) – американская киноактриса и певица. Самые популярные фильмы с ее участием: «Бестолковый» Эми Хекерлинг, «8 миля» Кертиса Хэнсона, «Молодожены» Шона Леви, «Любовь и другие катастрофы» Алека Кешишяна. Всего актриса снялась более чем в шестидесяти фильмах.', '
