INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (84, 'Тимур', 'Бекмамбетов', 'Тимур Бекмамбетов — российский кинорежиссёр, клипмейкер, продюсер и сценарист, получивший широкую известность и признание в 2004 году после выхода на экраны фантастического фильма «Ночной дозор». В его активе голливудские работы «Особо опасен», «Авраам Линкольн: Охотник на вампиров».', '
