INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (93, 'Стивен', 'Содерберг', 'Стивен Эндрю Содерберг — американский кинорежиссер, продюсер, сценарист, оператор и монтажер, известный благодаря своим режиссерским работам над фильмами «Траффик», «11 друзей Оушена», «Солярис», «Че» и продюсерским «Плезантвиль», «Бессонница», «Признания опасного человека», «Пиджак», «Спокойной ночи и удачи».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (94, 'Мэрил', 'Стрип', 'Мэрил Стрип – американская актриса кино и театра. Многократная обладательница премий «Оскар» и «Золотой глобус». Наибольшую известность обрела за роли в фильмах «Охотник на оленей», «Крамер против Крамера», «Выбор Софи», «Железная леди», «Мосты округа Мэдисон», «Манхэттен», «Адаптация» и «Часы».', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (95, 'Лукас', 'Хеджес', 'Лукас Хеджес (Lucas Hedges) — американский актёр, снимался у Уэса Андерсона и Терри Гиллиама. Номинант на премию «Оскар» за роль в драме Кеннета Лонергана «Манчестер у моря».', '
