INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (99, 'Марго', 'Робби', 'Марго Элис Робби (англ. Margot Elise Robbie) – австралийская актриса и продюсер, известная рядом ярких ролей в кино и на телевидении, на протяжении десятилетия носит негласный титул «секс-символа» современного кинематографа. Наибольшую славу Марго принесло воплощение образа комиксной злодейки Харли Квинн, а также участие в фильмах Мартина Скорсезе и Квентина Тарантино.', '
INSERT INTO public.actor_entity ("actorId", "firstName", "lastName", story, biography) VALUES (100, 'Себастиан', 'Стэн', 'Себастьян Стэн (англ. Sebastian Stan) - американский актер. Родился в Румынии в Констанце 13 августа 1982 года. Несмотря на то, что актер проживает в Америке, у него румынские корни. В родном городе Себастьян прожил до 8 лет. Когда мальчик был в этом возрасте, его мать-пианистка нашла в Вене работу, и семья переехала в Австрию. Но пробыла чета Стэнов там недолго. Спустя 4 года Себастьян с матерью переехали в США в округ Рокленд.', '
