Как актер Сергей дебютировал в 2003 году в сериале «Москва. Центральный округ», снявшись в роли Репейникова в молодости. В 2005 году на экраны вышла военная драма «Эшелон», в которой Бурунов прекрасно отыграл роль политрука, заслужив любовь и признание зрителей. Впрочем, настоящая известность пришла к Сергею в 2008 году, когда он стал постоянным актером рейтингового комедийного шоу на Первом канале «Большая разница». Там он заявил о себе как талантливый комик и пародист, сумев виртуозно изобразить массу знаменитостей. Параллельно с успехами в развлекательных программах пошла в гору карьера Бурунова и в телесериалах. В картинах «Отблески» (2009) и «Без права на ошибку» (2010) Бурунов исполнил уже главные роли. В 2011 году успех актера закрепился работой в сериале «Краткий курс счастливой жизни», где он исполнил роль брутального полицейского Тимура Валеева, с которым заводит долгоиграющий роман одна из главных героинь сериала. Бурунов появляется на экране далеко не сразу, но благодаря яркому образу и неординарным поступкам сумел запомниться, как едва ли не лучший мужской персонаж скандального проекта Валерии Гай Германики.
В статусе ведущего комедийного актера страны Бурунов появился в роли флегматичного майора ФМС Ивановского в популярном комедийном сериале канала СТС «Кухня» (2012). Двумя годами позже Бурунов снялся сразу в нескольких полнометражных фильмах, самыми успешными из них стали «В спорте только девушки» и «Неформат». В том же году зрители Первого канала увидели Бурунова в телешоу «Повтори!» В 2016 году Сергей приступил к исполнению самой известной своей роли – подполковника Владимира Яковлева в комедийном сериале «Полицейский с Рублевки». Бурунов составил с другой ярчайшей звездой российского кино Александром Петровым прекрасный тандем. В отличие от дерзкого опера угрозыска Измайлова, сыгранного Петровым, персонаж Бурунова показан как добросовестный и душевный сыщик, которому по роду деятельности приходится вникать в проблемы не самых приятных, зато очень обеспеченных жителей страны. Образ Яковлева так полюбился зрителям, что сериал просуществовал на телевидении в течение пяти сезонов, а затем получил два полнометражных продолжения «Полицейский с Рублевки. Новогодний беспредел» (2018) и «Полицейский с Рублевки. Новогодний беспредел 2» (2019).
