Помимо успешной актерской карьеры, Бурунов много работает над записью музыкальных клипов. О личной жизни Сергей предпочитает не распространяться, но в настоящее время всенародно любимый комик не женат.');
Виталий Петрович Шляппо родился 18 июня 1975 года в Витебске. Есть младший брат Алексей. Будучи студентом Витебского Государственного Университета, он начал принимать активное участие в играх КВН в составе команды БГУ, впоследствии был избран ее капитаном. Когда возглавляемая Виталием команда стала двукратным чемпионом Высшей Лиги КВН, молодой человек понял, что хотел бы заниматься в будущем не преподаванием математики (а именно педагогом должен был стать Виталий, получив диплом), а тем, что у него лучше всего получается, деятельностью, непосредственно связанной с юмором и творчеством.
В 2002 году Виталий начал работу на московской мультипликационной студии «Пилот-ТВ», где занимался разработкой сценария популярной сатирической телевизионной программы «Тушите свет». Через год Шляппо перешел на канал РЕН-ТВ. Здесь в соавторстве с бывшим соратником по команде КВН Алексеем Троцюком Виталий писал сценарии к популярным развлекательным программам и комедийным сериалам: «Дорогая передача», «Студенты», «Туристы», «Фирменная история», «Факультет юмора» и другим проектам.
Спустя три года Шляппо вместе с большой частью творческой команды Александра Муругова (в прошлом также участника сборной БГУ) перешел работать на канал СТС, где занял должность креативного продюсера, сценариста и разработчика множества полюбившихся широкой публике проектов: комедийных скетч-шоу «6 кадров», «Даешь молодежь», «Одна за всех», «МосГорСмех», «Нереальная история», юмористических передач «Уральские пельмени», «Слава Богу, ты пришел!», ситкомов «Игрушки», «Светофор», «Кухня», «Думай как женщина», «Последний из Магикян», «Два отца и два сына», «Корабль», «Неформат» и других, а также выступил продюсером полнометражного фильма «Кухня в Париже» и мелодраматической ленты Виктора Шамирова «Со мною вот что происходит» с Гошей Куценко в главной роли.
C 2008 года Виталий вместе с Алексеем Троцюком и Эдуардом Илояном является генеральным продюсером медиа-холдинга Yellow, Black and White Group.
В 2009 году Виталий Шляппо опять же в тандеме с Алексеем Троцюком стал лауреатом престижной российской кинопремии «ТЭФИ», победив в номинации «Сценарист телевизионного и художественного сериала» за комедийный сериал «Папины дочки».
В свободное время любит пересматривать мультфильмы про «Муми-троллей» и фильмы Марка Захарова. Женат.');

Федор Бондарчук родился 9 мая 1967 года в Москве, став вторым ребенком в звездном семействе – режиссера Сергея Бондарчука и актрисы Ирины Скобцевой. Воспитанием Федора занималась в основном бабушка, так как родители все время были заняты на съемках. Мальчик вел себя плохо, родителей постоянно вызывали в школу. Тем не менее, будущему режиссеру и телеведущему удалось закончить художественную и общеобразовательную школу. В 1985 году Бондарчук поступает во ВГИК в мастерскую Игоря Таланкина (режиссерско-постановочный факультет). Однако после первого курса института Федора призывали в армию. В 1987 году Федор возвращается во ВГИК, но уже в мастерскую под руководством Юрия Озерова. Вместе с Федором учился Иван Охлобыстин и Александр Башаров. Сыну известного режиссера приходится не только учиться, но и сниматься в картине «Сталинград» у Озерова. Роль в кино-эпопее «Сталинград» стала второй ролью в жизни Федора, дебютировал он годом ранее в историческом фильме Сергея Бондарчука – «Борис Годунов». В «Борисе Годунове» сын режиссера картины сыграл небольшую роль царевича Федора. По признанию Федора Бондарчука работать с отцом ему было сложно, он был строг, и надо было выкладываться во всю мощь. Окончив в 1991 году институт Бондарчук начал работу в студии «Art Pictures». Студия занималась съемкой видеоклипов, рекламных роликов и короткометражек. В 1993 году Федор Бондарчук получил премию «Овация» за свою работу на студии. Помимо работы в «Art Pictures Studio» Бондарчук продолжал сниматься в кино. До «Даун Хауса» (2001), который был принят критиками неоднозначно, но стал культовым в России фильмом, Бондарчук снялся в таких картинах как «Бесы”», «Арбитр», «Кризис среднего возраста» и «Восемь с половиной долларов». В 2005 году Федор Бондарчук снял самую кассовую картину в прокате этого года – «9 рота». В картине снялся племянник режиссера Константин Крюков, который смог показать себя как талантливого актера. Лента «9 рота» получила 7 различных кинопремий и выдвигалась в 2006 году от России на Оскар в номинации «Лучший фильм на иностранном языке». В 2009 году вышел фильм “»Обитаемый остров», который также стал самым кассовым фильмом в прокате стран СНГ и в России. Помимо актерской и режиссерской работы сын знаменитого режиссера Сергея Бондарчука Федор работает телеведущим. В 2003 году Федор Бондарчук был награжден премией ТЭФИ как «Лучший ведущий развлекательных программ» за работу в программе «Кресло» (телеканал СТС). И это довольно забавно, так как телеведущим Федор быть никогда не хотел. На телевидение он пошел, поспорив с другом Иваном Охлобыстиным.
В октябре 2012 года в широкий прокат вышла продюсерская работа Фёдора Бондарчука — кинопроект «Духless» по одноимённому роману Сергея Минаева, который стал самым кассовым российским игровым фильмом 2012 года. В том же году завершился съёмочный период фильма «Сталинград», который стал первой русскоязычной картиной в формате IMAX и вышел в прокат в 2013 году. В феврале 2012 года режиссёр картины Фёдор Бондарчук и продюсер Александр Роднянский официально объявили о начале сотрудничества с корпорацией IMAX Filmed Entertainment, в связи с чем Грег Фостер, её президент и председатель совета директоров, сказал: «Фёдор и Александр показали мне 15-минутный фрагмент «Сталинграда», и я очень рад, что мы не ошиблись с выбором партнёра».

Весной 2015 года вместе с молодым актёром Семёном Трескуновым специально для фильма «Призрак» Бондарчук исполнил жизнеутверждающую песню «Живи настоящим». Автором песни стал известный исполнитель Вася Обломов.

В последние годы как режиссер Федор снял дилогию о вторжении инопланетян «Притяжение» (2017) и «Вторжение» (2019), а также сериал «Псих» (2020) с Константином Богомоловым в главной роли. Если говорить о последних актерских работах Федора, то можно выделить его главные роли в таких фильмах и сериалах как: «Дед Мороз. Битва Магов» (2016), «Мифы» (2017), «Демон революции» (2017), «Год культуры» (2018), «Филатов» (2019), «Ленин. Неизбежность» (2019), «Спутник» (2020), «Окаянные дни» (2020). А в 2022 году нас ждет продолжение фильма «Призрак» с участием Федора Бонадрчука и Семена Трескунова.

Сейчас Федор Бондарчук женат на российской актрисе Паулне Андреевой. С ней он начал встречаться в 2015 году, а в 2019-ом они сыграли свадьбу. 2 марта 2021 года у пары родился сын. Паулина уже вторая жена Федора. До нее он был женат на Светлане Бондарчук, с которой познакомился еще во время службы в армии. Со Светланой у Федора два общих ребенка – сын Сергей и дочь Варвара. Также у Федора есть две внучки – Маргарита и Вера. ');
В 1990 Константин Хабенский поступает в Ленинградский Государственный Институт Театра, Музыки и Кинематографии (мастерская В.М. Фильштинского). В 1995 году он заканчивает ЛГИТМиК, играет в Экспериментальном театре «Перекрёсток» в течение года. В 1996 году Константин переходит в московский театр «Сатирикон», здесь актёр занят в основном на вторых ролях. В 1998 году он снимается сразу в трёх фильмах: «Наташа», «Женская собственность», «Хрусталёв, машину!». Благодаря участию в этих картинах Хабенского замечают, и вскоре он уже играет в триллере «Поклонник» и драме «Дом для богатых» Владимира Фокина. 
Первую славу актёру принёс сериал «Убойная сила», и сейчас ещё многие помнят его именно как «Игоря Плахова». С 1996 года Константин Хабенский играет в театре имени Ленсовета: спектакли «Калигула», «Войцек», «В ожидании Годо», «Поживём – увидим». В настоящее время Хабенский работает в театре МХАТ имени Чехова, где принимает участие в спектаклях «Белая гвардия», «Утиная охота», «Гамлет». Популярность актёра также обусловлена ролью Саши Гурьева в картине «В движении» Филиппа Янковского. Позже он снялся в «Статском советнике» того же Янковского.
Настоящую народную любовь и признание принесли Константину Хабенскому картины «Ночной дозор», «Дневной дозор», снятые по книгам Сергея Лукьяненко. Антон Городецкий стал, пожалуй, самой известной ролью Хабенского. В 2006 году актёр снимается в фильме «Час Пик». Одни из последних его работ – в фильме «Адмиралъ» (роль Александра Колчака) и в продолжении «Иронии судьбы» (роль Кости Лукашина). В 2010 году с участием Хабенского вышла картина «Выкрутасы» режиссёра Лео Габриадзе.
В 2017 году состоялся режиссерский дебют Константина Хабенского. На конференции "Кино Экспо" актер представил свою первую картину "Собибор". Хабенский исполнил в ней роль Александра Печерского. Работа над фильмом велась при поддержке Министерства культуры РФ и лично министра культуры Владимира Мединского. В широкий прокат "Собибор" вышел год спустя, 29 января 2018 года. На специальном показе картины присутствовали президент России Владимир Путин, премьер-министр Израиля Биньямин Нетаньяху, а также ветераны Великой Отечественной войны. 
Помимо актерской карьеры, Константин Хабенский широко известен как общественный деятель. В 2008 году Хабенский создал "Благотворительный фонд Константина Хабенского", который занимается помощью детям с онкологическими и другими тяжелыми заболеваниями. на церемонии награждения в 2012 году в Кремле, Константин Хабенский пришел со значком "Дети вне политики". Тем самым актер хотел привлечь внимание к проблеме усыновления детей, в связи с принятием "Закона Димы Яковлева". В 2016 году Хабенский во время прямой линии с Владимиром Путиным напомнил, что государство обязано обеспечивать детей аппаратами искусственной вентиляции легких на дому.
С 2010 года Константин Хабенский активно развивает детское творчество. Он открывает творческие студии развития по всей стране. В том числе в таких городах. как Воронеж, Нижний Новгород, Казань, Санкт-Петербург, Новосибирск, Уфа, Челябинск, Сочи, Иваново, Тольятти и Пермь.
В марте 2014 года "Благотворительный фонд Константина Хабенского" организовал благотворительный театральный проект под названием "Поколение Маугли". Почти все роли в котором были исполнены одаренными детьми из разных регионов, а роли "взрослых" героев исполняли профессиональные актеры, в числе которых Гоша Куценко, Диана Арбенина и сам Хабенский. Проект стал достаточно успешным и по итогу принес четырнадцать миллионов рублей, которые были потрачены на лечение 21 ребенка с онкологическими заболеваниями.
Что касается личной жизни, то до 2008 года Константин Хабенский был женат на журналистке Анастасии Хабенской. 1 декабря 2008 года Анастасия умерла от рака. От брака у Хабенского остался сын Иван. Второй раз актер женился в 2013 году на актрисе Ольге Литвиновой. Спустя три года у пары появилась дочь Александра. А уже 1 февраля 2019 года у Хабенского появился третий ребенок - дочь Вера.
За свою выдающуюся карьеру Константин Хабенский был удостоен следующих наград: "Заслуженный артист Российской Федерации" в 2006 году, "Народный артист Российской Федерации" в 2013 году, премия Министерства обороны Российской Федерации в области культуры и искусства в 2019 году, а также Государственная премия Российской Федерации в 2019 году.');
Ханс Флориан Циммер родился 12 сентября 1957 года в немецком городе Франкфурте. Ханс рано лишился отца. Как он признается, справиться с горем ему помогла музыка, которая стала «его лучшим другом». Еще будучи подростком, Ханс переехал в Великобританию. Там одаренный молодой человек начал с того, что играл на клавишных и синтезаторах сразу в двух группах - Ultravox и The Buggles, а также вместе с другом обучал игре на гитаре англичан. В 24 года Ханс написал сингл «Video Killed the Radio Star», с которого началось существование телеканала MTV. В 1984 году 27-летний Циммер дебютировал как кинокомпозитор в фильме Ежи Сколимовского «Успех – лучшая месть», который номинировался на «Золотую пальмовую ветвь». Уже в начале пути, в 80-90-ых годах, Циммер стал очень востребован: он привлекал режиссеров прежде всего тем, что талантливо объединял новые и старые музыкальные технологии (например, электронную музыку в сочетании с традиционной оркестровой). Когда режиссер Барри Левинсон попросил Ханса написать музыку к его драме «Человек дождя» (1988), Циммер уже был довольно популярным кинокомпозитором. 
«Придумывая музыку к «Человеку дождя», я все время говорил себе: не пытайся заглушить героев. Не лезь на первый план. Реймонд, главный герой, на самом деле не понимает, где он находится. Он видит мир не так, как мы.… Почему бы не создать «музыку мира» для мира, который существует только в его голове?» - вспоминает Ханс. Эта работа стала настоящим прорывом в его карьере – Циммер удостоился номинации на премию «Оскар». Лучшие режиссеры Голливуда выстроились в очередь, чтобы работать с ним. И Ханс отдавался работе полностью, часто придумывая музыкальные темы для двух-трех картин одновременно. Работая над фильмом «Сила личности» (1992), композитор даже отправился в Южную Африку, чтобы использовать в саундтреке африканские национальные хоры. Его музыка так впечатлила студию «Дисней», что они заказали Циммеру композицию для мультика «Король-лев» (1994). Но в ЮАР Ханса больше не пускали, поэтому он вызвал южноафриканского музыканта Лебо М в Америку. Музыкальная тема мультфильма принесла композитору три престижнейшие награды – «Оскар», «Золотой глобус» и «Грэмми». В дальнейшем Циммер продолжал получать многочисленные награды, став поистине лучшим из лучших в Голливуде. Редкая церемония «Оскар» обходится без номинанта Циммера. Он автор музыки ко многим популярным картинам: «Миссия невыполнима 2», «Скала», «Гладиатор», «Принц Египта», «Перл-Харбор», «Тонкая красная линия», «Падение черного ястреба», «Мадагаскар», «Код да Винчи», «Пираты Карибского моря: Сундук мертвеца», «Бэтмен: Начало», «Темный рыцарь», «Начало». В Америке Ханс основал собственную студию «Remote Control Productions», которая помогает молодым композиторам (Стив Яблонски, Джефф Занелли и др.). 55-летний Ханс Циммер живет в Лос-Анджелесе с женой и четырьмя детьми. «Мне кажется, я хорошо умею чувствовать дух времени, - признается он. - Сейчас мне хочется работать с тремя, четырьмя нотами, которые уложены в сложную, запутанную эмоциональную структуру. С эмоциональностью, а не сентиментальностью». ');
 В 1988 году Гоша Куценко вместе со своими родными переехал в Москву. В столице актёр поступил в МИРЭА, однако вскоре понял, что его больше интересует театр. По этой причине он решил в дальнейшем обучаться в Школе-Студии МХАТ, что очень удивило его родителей, далёких от мира кинематографа и театра. При поступлении Гоша Куценко декларировал «Исповедь хулигана». Приёмную комиссию позабавило то, как выступал юноша с украинским акцентом и картавой речью. Олег Табаков, которого особенно забавляла речь абитуриента, несколько раз уточнял имя Гоши, чтобы в очередной раз услышать его ответ: «Югхий!». Вдруг абитуриент вместо привычного «Югхий!» произнёс неожиданное «Гоша. Меня так мама в детстве называла…». Этим он ещё сильнее позабавил приёмную комиссию. Нетрудно догадаться, что его зачислили. В студенческие годы Гоша Куценко женился на актрисе Марии Порошиной, и у них вскоре родилась дочь Полина. Несмотря на то, что брак был недолгим, отношения между актёрами сохранились дружеские. В ряде фильмов они даже снимались вместе.
 В 1991 году Гоша Куценко дебютировал в эпизоде фильма «Человек из команды «Альфа». В этом же году ему доверили одну из главных ролей в комедии-фарсе «Мумия из чемодана». В дальнейшем он снимался в картинах «Дети чугунных богов», «Ноктюрн для барабана и мотоцикла», «Сны», «Серп и молот», «Мама, не горюй». С 1995 года Гоша начинает работать на телевидении, но через некоторое время это ему становится неинтересно. Известность к актёру пришла после его участия в боевике «Антикиллер». Благодаря роли Лиса Куценко заметили. В настоящее время актёр успешно работает и в кино, и в театре. Также он является совладельцем одной из известных кинокомпаний.');

Уолтер Брюс Уиллис родился 19 марта 1955 года в немецком городе Идар-Оберштайн. Отец Брюса был американским военным, а мать — работавшей в банке немкой. Когда у отца закончился контракт с Вооружёнными силами США, семья возвратилась в город Пеннс-Гроув, штат Нью-Джерси. По большей части, именно здесь прошли бурные детские годы будущего актёра. Семью Брюса можно было назвать многодетной, из четырёх детей он являлся самым старшим. В детстве Брюс заикался, из-за чего испытывал проблемы с речью. Причина заикания крылась в волнении практически по любому поводу. Чтобы пересилить свой недуг и набраться уверенности, юный Брюс записался в школьный театральный кружок, где он также освоил игру на губной гармошке. Брюсу настолько сильно понравилось выступать на сцене, что вскоре это переросло в привычку. Погрузившись в творческий азарт, Брюс стал участвовать в более серьёзных постановках, в которых он поднаторел как начинающий драматический актёр. После окончания школы и учёбы в университете, Брюс перебирается в Нью-Йорк. В поисках дальнейших перспектив, он берётся за подработки в местных барах. Обязанности бармена Брюс совмещал с музыкальными номерами в составе блюз-группы. Работая в барах, Брюс часто думал о кинокарьере. Порой его размышления сводились к отчаянию, «лекарством» от которого было спиртное. Тем не менее Брюс старался не пускаться во все тяжкие, и даже во время работы он мог развлекать как себя, так и гостей. 

Работая в одном из баров, Брюсу посчастливилось познакомиться с кастинг-директором, который, по иронии судьбы, искал актёра для исполнения эпизодической роли бармена. Уиллис отлично подходил для роли своей необычной фактурой вкупе с заметной для многих посетителей заведения лучезарной харизмой, и именно поэтому выбор пал на него. Отныне Брюс участвовал в различных съёмках в кино, периодически выступал на сцене непопулярных театров и появлялся на телевидении. Как бы то ни было, достававшиеся ему роли перед камерой ограничивались до обидного непродолжительными эпизодами. Но всё изменилось, когда Брюса позвали сниматься в комедийно-драматический сериал «Детективное агентство «Лунный свет»» (1985 — 1989). Уиллис сыграл озорного частного детектива Дэвида Эддисона, и это была его первая главная роль. На момент старта съёмочного процесса, актёру исполнился уже 31 год. За Брюсом закрепилась репутация подающего надежды комика, но сам актёр не собирался играть исключительно комедийных персонажей. Настоящий прорыв для Уиллиса произошёл, когда в 1988 году он снялся в ныне культовом боевике «Крепкий орешек». Роль копа Джона Макклейна, не теряющего оптимизма даже в самых удручающих ситуациях, сделала из Брюса Уиллиса звезду мирового масштаба. Впоследствии «Крепкий орешек» перерос в одну из популярнейших кинофраншиз, которая показательно демонстрирует, каким должен быть зубодробительный экшен, щедро сдобренный самоиронией. 

Актёр начал блистать как никогда. Но бывало, что не спасали ни талант, ни харизма Брюса, и поэтому в его фильмографии случались как коммерческие, так и связанные с профильной критикой провалы. Одним из таких провалов была комедия 1991 года «Гудзонский ястреб» и драма 1994 года «Цвет ночи». Однако в том же 1994 году с участием актёра выходит оскароносный и усыпанный всяческими кинонаградами фильм Квентина Тарантино «Криминальное чтиво». Роль профессионального боксёра Бутча Куллиджа стала для Брюса одной из самых важных в его карьере. После Уиллис снимается в успешном фантастическом боевике Люка Бессона «Пятый элемент» (1997) и становится спасителем мира в ещё более успешном фильме-катастрофе Майкла Бэя «Армагеддон» (1998). В 1999 году кинотеатры штурмует мистический триллер М. Найт Шьямалана «Шестое чувство», окончательно закрепивший за Брюсом Уиллисом статус звезды первой величины, благодаря которой киностудии зарабатывают сотни миллионов долларов. Девяностые годы проходят для Уиллиса с оглушительным триумфом, кассовых фильмов с ним действительно хватает, а те фильмы, что не оправдали себя в плане сборов и не снискали обласканных рецензий кинокритиков в начале десятилетия, со временем полюбились обычным зрителям. 

В двухтысячных карьера Брюса Уиллиса и не думала жать на тормоза, наоборот — перспективных проектов только прибавилось. Сначала Уиллис играет наёмного убийцу в знаковой комедии «Девять ярдов» (2000) и перевоплощается в сверхчеловека с психологической уязвимостью в нестандартном супергеройском триллере «Неуязвимый» (2000). В 2005 году выходит нуарный кинокомикс Роберта Родригеса «Город грехов». В данном фильме, основанном на небольшой серии графических романов Фрэнка Миллера, было множество актёров А-класса, и Брюс Уиллис, сыгравший самоотверженного детектива Джона Хартигана, конечно же, являлся одним из них. В последующие годы актёр снимается в ряде выдающихся лент, среди них: «Счастливое число Слевина» (2006), «16 кварталов» (2006), «Планета страха» (2007), «Суррогаты» (2009), «РЭД» (2010), «Петля времени» (2012), «Жажда смерти» (2018), «Стекло» (2019), «Сиротский Бруклин» (2019). Отдельного упоминания в фильмографии Уиллиса заслуживает боевик Сильвестра Сталлоне «Неудержимые» (2010), в котором Слай собрал почти всех самых известных актёров, прославившихся колоритными ролями в боевиках. В последние годы стало очевидно, что карьера Брюса Уиллиса претерпела падение, так как действительно крупных ролей у него нет, поэтому иногда актёру приходится сниматься в проходных фильмах. С 1987 года по 2000 год Брюс был женат на актрисе Деми Мур, в браке у них родились три дочери. В 2009 году Уиллис женился на модели Эмме Хеминг, которая родила от него двух дочерей.');
Андрей Мерзликин родился 24 марта 1973 года в Московской области, в городе Королеве. После школы учился на радиотехника и не грезил об актерской карьере. Когда в лихие 90-е в стране ударил кризис, Андрей рассудил, что лучше всего получить экономическое образование, чтобы крепко стоять на ногах. Учась на экономиста, от знакомой девушки он узнал, что та собирается поступить в театральный вуз, и немало удивился: разве актерами не рождаются? Тогда-то Андрей и решил, что хочет получить актерское образование и играть. Так он поступил на актерский факультет ВГИКа (мастерская Е. А. Киндинова). Во время учебы Мерзликин часто снимался у молодых режиссеров. Так, в 1998 году он исполнил главные роли в короткометражках «Айлостера», «Финал», а также короткой драме Ильи Хотиненко «Почему ты меня любишь?» вместе с Аленой Бабенко. А за работу в короткометражке «Как я провела лето» (1999) Натальи Погоничевой Мерзликин получил приз на фестивале ВГИКа. 
После выпуска начинающий актер снимался в эпизодах – у Евгения Матвеева «Любить по-русски 3: Губернатор», у Эльдара Рязанова в «Старых клячах» (играл адъютанта), у Ильи Хотиненко в картине «Лицо французской национальности» (милиционер). Одновременно актер работал в театре под руководством Армена Джигарханяна и играл, в том числе ведущие роли (Фигаро, Вершинин). Успех и узнаваемость к Андрею Мерзликину пришли через пару лет, когда 30-летний актер появился в легендарном фильме Петра Буслова «Бумер» (2003). В этой криминальной саге Андрей сыграл роль одного из бандитов – Димона Ошпаренного. С этого фильма началось восхождение талантливого актера на вершину российского шоу-бизнеса. Лучшие роли Мерзликина были еще впереди. Он снялся во множестве телесериалов («Штрафбат», «Герой нашего времени», «Убойная сила») и фильмов («Охота на пиранью», «Обитаемый остров», «О, счастливчик!»). 
В 2004 году Мерзликин в общей компании познакомился со своей будущей женой, психологом Анной Осокиной. Вторая встреча состоялась через год. В 2006-ом году 33-летний актер женился на возлюбленной. У Мерзликиных трое детей (сын и две дочери). 
Андрей по праву считается одним из лучших драматических актеров в стране. Особенно ярко его талант выражается в фильме Антона Сиверса «Дом на обочине» (2010). Герой Мерзликина – обеспеченный бизнесмен, женатый на взбалмошной и своенравной девушке. При ней он чувствует себя подкаблучником, однако жизнь течет своим чередом, и ничего не меняется, пока Андрей случайно не сбивает на загородной дороге деревенского жителя. Решая ему помочь, он находит семью потерпевшего – женщину необразованную, бедную, но невероятно красивую и гармоничную. Не в силах совладать с собой, герой Мерзликина влюбляется в незнакомку. Пока муж в коме, они живут как настоящая счастливая семья в доме на обочине. Но когда жертва ДТП начинает идти на поправку, неоднозначная ситуацию усугубляется. Мерзликин с удовольствием снимается не только в высокобюджетных картинах, но и у независимых режиссеров. В 2012 году он сыграл в короткометражке Михаила Сегала «Рассказы», где исполнил роль устроителя свадеб – гуру своего дела, который предлагает обратившейся к нему паре рассчитать свое будущее до мелочей, вплоть до измен… Востребованность актера усиливается с каждым годом. В 2013-ом Мерзликин снимается в амбициозном проекте Андрея Кавуна – сериале «Шерлок Холмс»');
Уильям Брэдли Питт родился 18 декабря 1963 года в штате Оклахома, в католической семье. Отец будущего киноактера трудился менеджером в компании по грузоперевозкам, а мать была учительницей в школе. Детство Брэда прошло в штате Миссури, куда семья переехала, в связи с работой отца. Питт рос разносторонне развитым мальчиком, увлекался спортом, музыкой и состоял в клубе дебатов. После окончания школы он взялся изучать журналистику и рекламное дело в университете Миссури, но бросил его, не доучившись, и отправился в Лос-Анджелес, где сменил свое имя с Уильяма на более короткое – Брэд. Он начал посещать курсы актерского мастерства, а работать устроился зазывалой при ресторане в костюме огромного цыпленка. Вскоре ему удалось получить роль в знаменитой мыльной опере «Даллас», шедшей на телевидении в течение 13 лет.
В 1988 году 25-летнему Брэду впервые досталась главная роль в драме «Темная сторона Солнца», однако более заметным получилось участие в фильме «Тельма и Луиза» (1991). В то же время вышло несколько не столь удачных картин с его участием, таких как «Джонни-замша» (1991), «Параллельный мир» (1993), «Калифорния» (1993) и «Настоящая любовь» (1993). Следующий 1994 год становится для Питта прорывным, поскольку одна за другой выходят обласканные признанием «Легенды осени», где Брэд отыграл вместе с «оскароносным» Энтони Хопкинсом, а также «Интервью с вампиром», в котором Брэд пересекся с другим признанным красавцем-актером Томом Крузом. В следующем году Брэд Питт впервые номинируется на «Оскар» и получает «Золотой глобус» за роль второго плана в фильме «Двенадцать обезьян». 
Уже в ранге звезды первой величины Питт исполняет главную роль в неонуарном триллере Дэвида Финчера «Семь», приумножив свою славу как многогранного актера, способного одинаково органично смотреться как романтический герой или трагик. Двумя годами позже Брэд влипает в политический скандал из-за своего участия в фильме «Семь лет в Тибете» (1997) и высказываний в поддержку тибетцев. Однако никакие обиды китайских властей не могу остановить рост популярности актера. Питт становится нарасхват у самых модных и востребованных режиссеров. Второй раз за карьеру Брэд снимается у Дэвида Финчера, и их новый совместный фильм «Бойцовский клуб» по одноименному роману Чака Паланика становится настоящим культурными феноменом. По признанию ряда авторитетных журналов, образ таинственного Тайлера Дердена получился одним из ярчайших персонажей в истории кинематографа. Питт окончательно закрепляет репутацию самого желанного голливудского актера. Столь же успешным получается и сотрудничество Брэда с британским режиссером Гаем Ричи. В ленте «Большой куш» (2000) Питт исполнил роль цыгана Микки, и, несмотря на малое количество экранного времени, сумел запомниться наряду с центральными персонажами картины.
Годом позже Питт вливается в актерский ансамбль криминальной драмы «Одиннадцать друзей Оушена» (2001) на правах столь же яркой, как Джордж Клуни, звезды. В 2004-м на экраны выходят блокбастер «Троя» и «Двенадцать Друзей Оушена», еще через год Брэд пересекается с Анджелиной Джоли на приключенческой комедии «Мистер и миссис Смит». Экранный союз перерастает в романтические отношения, а затем и в свадьбу. В браке у супругов появилось трое детей, еще стольких же они усыновили. На протяжении последующих пятнадцати лет Питт и Джоли удерживали статус самой красивой пары Голливуда, пока не расстались в 2019-м.
В 2006-м году образовался еще один знаковый актерский тандем Брэда Питта – на этот раз с австралийской обладательницей «Оскара» Кейт Бланшетт. Они играют семейную пару в драме Алехандро Иньяритту «Вавилон», а два года спустя воссоединяются у Финчера в фантастической ленте «Загадочная история Бенджамина Баттона» (2008). По сюжету этого фильма, Питт играет мальчика, родившегося стариком и проживающего жизнь наоборот, тогда как его возлюбленная в исполнении Бланшетт живет обычной жизнью. Фильм получил большое количество наград, а Питт – очередную номинацию на «Оскар». Еще раз Брэд был номинирован за главную роль в спортивной драме «Человек, который изменил всё» (2011), где воплотил реального человека – менеджера Билли Бина, сумевшего при минимуме средств создать мощную бейсбольную команду. Заветный «Оскар» Питт получает через год – как один из продюсеров фильма года «12 лет рабства», посвященного трагическим событиям американской истории.
Награда американской киноакадемии уже как актеру продолжает оставаться целью Брэда Питта, который не устает радовать своих многочисленных поклонников разнообразием ролей. В 2014-м Питт играет в военной драме «Ярость», годом позже в политическом триллере «Игра на понижение», однако настоящий триумф ожидает Брэда в фильме Квентина Тарантино «Однажды в Голливуде». Питт исполнил роль бывшего морпеха Клиффа Бута, ставшего средней руки каскадером и дублером меркнущей звезды вестернов в исполнении Леонардо ДиКаприо. Питт запомнился аудитории множеством ярких сцен, среди которых драка с легендарным Брюсом Ли, визит в общину печально известного Чарлза Мэнсона и противостояние его фанатикам в концовке ленты. Выдающееся исполнение колоритного персонажа принесло Питту «Оскар» в номинации «лучший актер второго плана». В том же году Брэд отлично отыграл в космической драме «К звездам».');
Родился 15 апреля 1982 года в канадском городе Ванкувере. Его мать является социальным работником, а отец состоит в должности помощника директора ассоциации Workmen''s Circle. Старшая сестра Сета также занимается работой в социальной сфере. Уже подростком Роген стал играть в кино, а среди его первых работ была роль в сериале «Чудики и чокнутые», а в 2001-м году его взяли в актерский состав сериала «Неопределившиеся». В том же году он сыграл в психологическом триллере «Донни Дарко» и отметился в популярном сериале «Бухта Доусона». В 2004-м с его участием на экраны вышла комедийная мелодрама «Телеведущий», а уже на следующий год он блестяще исполнил второстепенную роль в картине «Сорокалетний девственник». Актерская карьера Сета развивалась, и в 2006-м он был задействован в нескольких проектах, среди которых драма «Немножко беременна», фильм «Помоги мне, помоги мне» и комедийная мелодрама «Он, я и его друзья», где также сыграли такие звезды, как Оуэн Уилсон, Мэтт Диллон, Кейт Хадсон и Майкл Дуглас.
Очередным успехом для Рогена стало участие в комедийной мелодраме «SuperПерцы». В 2008-м Сет снялся в криминальной драме «Фанаты», комедии «Сводные братья», комедийной драме «Зак и Мири снимают порно», где ему досталась одна из главных ролей, как и в триллере «Ананасовый экспресс: сижу, курю». В последующие годы Сет также сыграл в ряде фильмов, среди которых «Приколисты», «Типа крутой охранник», «У меня рак» и «Зеленый Шершень», где он выступил также в качестве сценариста. А среди последних его работ - картины «Примите этот вальс» и «Жизнь прекрасна». 
Кроме того, Роген принимал активное участие в озвучивании мультипликационных персонажей, и его голос можно услышать в таких мультфильмах, как «Шрэк Третий», «Спайдервик: Хроники», «Хортон», «Кунг-фу Панда», «Монстры против пришельцев» и «Кунг-фу Панда 2». Также Сет в последнее время успешно пишет сценарии, а в 2005-м году был номинирован на премию «Эмми» в категории «Лучший сценарий к комедийной программе».');
Родился 20 октября 1958 года в Нью-Йорке, в семье американки и датчанина. В 1960 году чета переехала в Южную Америку, девять лет детства будущего актера прошли в Аргентине и Венесуэле, благодаря чему он овладел испанским языком. В 1969-м году супруги развелись, и Вигго вернулся вместе с матерью в Нью-Йорк. В школе он серьезно занимался теннисом, был капитаном команды по плаванию, а также увлекался фотографией.
После окончания в 1980-м году университета св. Лоуренса Мортенсен отправился в Данию (он частенько проводил каникулы на ферме своего деда). В тот период он работал то официантом, то продавцом цветов, то водителем грузовика. Спустя два года Вигго вернулся в США. Он задумался о карьере актера, начал посещать школу актерского мастерства Уоррена Робертсона, принимал участие в театральных постановках. В кино он дебютировал в 1985-м с небольшими ролями в фильмах «Свидетель» и «Пурпурная роза Каира». Затем наступило несколько лет затишья и работ в малоизвестных картинах. На съемках ленты «Спасение» актер познакомился с вокалисткой панк-рок группы Эксен Цервенкой. Вскоре они поженились, в 1988-м году у пары родился сын. В 1990-х Вигго сыграл в популярных фильмах «Путь Карлито», «Багровый прилив», «Дневной свет», «Пророчество», «Идеальное убийство» и «Солдат Джейн». Его партнерами по съемочной площадке выступили звезды Голливуда: Аль Пачино, Кристофер Уокен, Николь Кидман и Дэми Мур.
В 1996-м году Вигго расстался с женой, но сохранил с ней хорошие отношения и принимал активное участие в воспитании сына. Его актерская карьера плавно шла в гору. Он отметился в лентах «28 дней», «Идальго: Погоня в пустыне», но настоящим прорывом стала роль Арагорна в знаменитой трилогии «Властелин колец» по роману Толкиена. Фильм получил множество наград, критики, пресса и зрители не обошли своим вниманием и Мортенсена. Ему поступало немало интересных предложений от кинематографистов. Актер снялся в картинах «Оправданная жесткость» Дэвида Кроненберга, «Аппалуза», «Дорога», «Порок на экспорт» (номинация на «Оскар»), в процессе подготовки к которой провел некоторое время в России. Последние яркие работы Вигго – «Опасный метод» и «На дороге».
Мортенсен – очень разносторонняя творческая личность. Он продолжает заниматься фотографией, которой увлекся еще в школе. Благодаря другу, актеру Дэннису Хопперу, он устроил в 2000-м году свою первую фотовыставку. Кроме того, Вигго пишет картины, обзавелся собственной студией, основал издательство Perceval Press для печати некоммерческих произведений, где заодно публикует книги со стихотворениями и рассказами собственного сочинения. Мортенсен находит время и для музыки: играет джаз на пианино, поет и уже выпустил несколько альбомов со своими песнями.');
Родился 16 февраля 1974 года в Окленде, штат Калифорния, вырос в Хейварде. Его мать — священник, а отец – актер, появлялся в театральных постановках на Бродвее. Он был назван в честь одного из сыновей пророка Исайи в Библии. Воспитанный как христианин, он позже принял ислам, и сменил свою фамилию с Гилмор на Али. В 1996 году Али окончил Калифорнийский колледж святой Марии с учёной степенью в массовой информации. 
В юности Махершала планировал стать баскетболистом, но передумал после того, как впервые сыграл в пьесе. Позже он присоединился к калифорнийскому театру имени Шекспира.
После ролей в сериалах «Карточный домик» и «Люк Кейдж», а также франшизе фильмов «Голодные игры», Махершала получил роль в независимой драме Барри Дженкиса «Лунный свет», роль в которой принесла ему многочисленные награды и номинации, включая «Выбор критиков» в категории «Лучший актёр второго плана» и номинацию на премию «Золотой глобус». 
Также актер снялся в фильме «Скрытые фигуры», еще одном (помимо «Лунного света») претенденте на «Оскар» в 2017 году.');
Родился 17 августа 1943 года в Нью-Йорке, в семье скульптора и художника Роберта Де Ниро старшего и Вирджинии Адмирал, также художницы. Но спустя два года пара рассталась. Детство Роберта прошло в районе итальянских иммигрантов, где у него из-за бледного вида была кличка Бобби-Молоко. Уже в возрасте десяти лет юный Де Ниро дебютировал на сцене в школьной постановке «Удивительный волшебник из страны Оз». Мать Роберта, с которой он и стал жить после развода родителей, уделяла ему не так много времени, но хорошо обеспечивала его, и именно по ее настоянию он поступил в Высшую школу музыки, искусства и исполнительского мастерства имени Фьорелло Ла Гуардия в Нью-Йорке. Актерскому мастерству Роберт Де Ниро обучался у Стеллы Адлер и Ли Страсберга, которые были приверженцами системы Станиславского, в итоге метод стал использовать и сам Де Ниро, тщательно примеряя на себя каждую роль задолго до съемок. 
Первой ролью для кино стало появление Де Ниро в 1963-м году в комедии Брайана Де Пальмы «Свадебная вечеринка», но выход картины был отложен на несколько лет из-за банкротства кинокомпании и увидел свет лишь в 1969-м. После роли в картине Брюса Присона «Бей в барабан медленно», вышедшей в 1973-м, Роберта Де Ниро замечают и даже дают премию объединения кинокритиков Нью-Йорка. Но действительно поворотным моментом стала его встреча с Мартином Скорсезе, тогда еще неизвестным режиссером. Оказалось, что они выросли в одном квартале и были знакомы в детстве, пусть и не очень дружны. Так и досталась Роберту Де Ниро роль Джонни-боя в имевшей немалый успех ленте «Злые улицы». Самому Де Ниро за игру в этом фильме дали премию Национального совета кинокритиков США. Но что важнее, на него обратил внимание Фрэнсис Коппола, Де Ниро получил роль в продолжении «Крестного отца» и в итоге за свою великолепную игру был награжден «Оскаром». К тому же, премия была дана за роль, озвученную на иностранному языке, ведь герой Де Ниро говорил на итальянском. Стоит отметить, что Роберт Де Ниро и Марлон Брандо оба получили «Оскара» за воплощение одного и того же образа в разные годы его жизни. 
	После «Крестного отца 2» Роберт Де Ниро продолжает свое плодотворное сотрудничество с Мартином Скорсезе в фильме «Таксист», для подготовки исполнения роли в котором Роберт провел немало времени, разъезжая по улицам Нью-Йорка. Дальше волна успеха продолжается. В 70-х с участием Де Ниро выходят такие фильмы, как «Двадцатый век»(1976), затем снятый по незаконченному роману Скотта Фицджеральда «Последний магнат» (1976), мюзикл «Нью-Йорк, Нью-Йорк»(1977) для которого Де Ниро брал уроки игры на саксофоне, и «Охотник на оленей» (1978), получивший пять «Оскаров». В 1980-м происходит очередное успешное сотрудничество Де Ниро и Скорсезе, для съемок в котором Де Ниро подолгу тренировался на ринге и набрал более 20 кг веса. Как итог, фильм «Бешеный бык» получил две премии «Оскар», одна из которых досталась самому Де Ниро за лучшую мужскую роль.
 	Следующей яркой ролью стала игра в гангстерской саге «Однажды в Америке», после которой следует множество ролей в различных фильмах, но в них Роберт Де Ниро зачастую играет несколько определенных типажей, чаще всего полицейских или преступников. Правда, играет их великолепно. С его участием выходят такие фильмы, как «Бразилия» (1985), «Неприкасаемые» (1987), «Сердце Ангела» (1987), «Успеть до полуночи» (1988), «Славные парни» (1990), «Пробуждение» (1990), «Мыс страха» (1991), «Бешеный пес и Глори» (1993), «Бронкская история» (1993), «Казино» (1995), «Схватка» (1995), «Фанат» (1996), «Ронин» (1998), «Шоу начинается» (2002). Стоит отметить, что в «Бронкской истории» Роберт Де Ниро пробует себя также как режиссер, что получается у него вполне успешно. В 2015 году Де Ниро поставит «Бронкскую историю» на сцене театра в виде мюзикла. 
В 2000-х годах Де Ниро много снимается в фильмах различных жанров, картины с его участием привлекают большое количество зрителей, но критики уже не дают столь высоких оценок, как в былые времена. В те годы выходят «Военный ныряльщик» (2000), «Знакомство с родителями» (2000), «Медвежатник» (2001), «15 минут славы» (2001), «Шоу начинается» (2002), «Анализируй то» (2002), «Знакомство с Факерами» (2004), «Ложное искушение» (2006), «Право на убийство» (2008), «Однажды в Голливуде» (2008), «Все путем» (2009). Однако участие во многих коммерчески выгодных, но сомнительных, с точки зрения актерского престижа, лентах объяснялось тем, что после трагичных событий 11 сентября 2001-го года в Нью-Йорке Роберт Де Ниро стал одним из организаторов благотворительного кинофестиваля «Трайбека», созданного с целью содействия восстановлению районов Манхэттена, затронутых атаками террористов. Роберт сам широко содействовал фонду, перечисляя прибыль от своих гонораров. 
 	В 2009 году Роберт Де Ниро был удостоен премии «Британия» за личный вклад в развитие кинематографа, а в январе 2011 года получил второй «Золотой глобус» за вклад в развитие кинематографа на протяжении всей карьеры.
 	2010 год в карьере актера нельзя назвать плодотворным. Он воссоединился с Беном Стиллером во второй части «Знакомства с Факерами» (2010), сыграл главную роль в провалившимся в прокате криминальном триллере «Стоун» (2010), который не смог даже спасти звездный актерский состав, а также исполнил второстепенную роль коррумпированного сенатора в проекте Роберта Родригеса «Мачете» (2010). 
 	Зато 2011 год стал для Де Ниро более плодотворным. Он 	снялся в пяти голливудских фильмах: «Быть Флинном» (2011), «Профессионал» (2011), «Старый Новый год» (2011), «Области тьмы» (2011), «Красные огни» (2011), а также в итальянской романтической комедии «Любовь: Инструкция по применению» (2011), в которой Роберт сыграл совместно с Моникой Беллуччи. Роль в данном фильме была очень высоко оценена критиками, которые считали ее лучшей на фоне ролей в незамысловатых голливудских комедиях. 
 	В 2012 году актер также отметился в посредственном криминальном боевике «Фрилансеры» (2012) и драмеди «Мой парень — псих». За роль во втором фильме Роберт был номинирован на премию «Оскар». 
В 2013 году актер отметился в незамысловатых криминальных боевиках «Сезон убийц» (2013) и «Мотель» (2013). Но они меркнут на фоне комедий «Малавита» (2013), «Starперцы» (2013) и «Большая свадьба» (2013), в которых отметились весьма звездные актеры. А в фильме «Забойный реванш» (2013) Роберт снова исполнил роль боксера. Однако в отличии от Джейка Ламотты, роль в «Забойном реванше» получилась куда более комичной. 
 	Период с 2015 по 2017 года в карьере актера не представляют ничего интересного, за исключением фильма «Джой» (2015), в котором Роберт Де Ниро снова поработал с режиссером фильма «Мой парень-псих» (2012).  
2019 год в карьере Роберта Де Ниро интересен двумя громкими фильмам: «Ирландец» (2019) и «Джокер» (2019). В «Ирландце» (2019) Де Ниро снова поработал со своими лучшими друзьями: актером Джо Пеши и режиссером Мартином Скорсезе. Оба фильма получили хвалебные оценки критиков, а также были удостоены множества наград, включая премию «Оскар». 
 	Помимо актерской деятельности, Роберт Де Ниро активен и успешен в бизнесе. Совместно с популярным в США шеф-поваром японской кухни Нобу Мацухиса и ещё некоторыми партнёрами, Де Ниро является владельцем компании Nobu Hospitality (Гостеприимство Нобу), которая предоставляет услуги высшего класса в гостиничном и ресторанном бизнесе, и всемирной сети ресторанов «Nobu». В Москве два ресторана «Nobu» были открыты в 2009 и 2015 годах. Кроме перечисленного, Де Ниро является совладельцем ресторанов «Трайбека Гриль», «Локанда Верде», гостиницы «Гринвич Отель» и ряда других предприятий. К тому же, Роберт владеет рестораном «Рубикон» в Сан-Франциско совместно с режиссером Фрэнсисом Фордом Копполой. Ресторан известен своей картой вин, которая в различные годы достигала 1700 наименований и неоднократно отмечалась специальными премиями.
 	Несмотря на почтенный возраст, Роберт Де Ниро продолжает радовать поклонников своими ролями в кинофильмах и на пенсию уходить не планирует.');
Родилась 17 ноября 1974 года в Северной Дакоте. Полное имя – Лесли Луис Бибб. Девочка рано потеряла отца, поэтому ее семье – маме и двум сестрам –пришлось жить очень скромно, денег хватало только на самое необходимое. Когда Лесли исполнилось 16 лет, мама разослала ее фотографии по всем модельным агентствам. В это время компания «Еlite» проводила общенациональный конкурс моделей, на котором Лесли победила и получила контракт на работу в Нью-Йорке. Все лето Лесли снималась для журналов мод, а потом ей нужно было возвращаться в Верджинию, где она училась в университете. Юная модель сдала сессию и опять погрузилась в мир съемок. Более трех лет Бибб постигала профессию в студии Уильяма Эспера. 
В кино ее дебют состоялся в сериале «Большой ремонт», затем последовало множество маленьких эпизодов в самых разных картинах. И наконец звездный час – участие в сериале «Лучшие». Лесли сыграла самую известную девушку в школе Кеннеди. Сериал стал очень популярен среди подростков. Продюсеры подогрели интерес зрителей сувенирной продукцией, повсюду продавались календари и журналы с фотографиями героини Лесли. Так бывает после настоящего успеха. Лесли Бибб только успевала получать все новые и новые предложения сниматься. Сегодня в ее фильмографии триллеры, комедии, ужастики, драмы и множество сериалов, среди которых еще одна телевизионная бомба сериал «Скорая помощь», фильмы «Абсолютное зло», «Мой парень из зоопарка», «Старая добрая оргия». Лесли выпустила несколько проектов как продюсер. Одна из таких картин в которых Лесли также сыграла главную роль «Мисс Никто». За нее Бибб вручили награду «Лучшая актриса» на Бостонском международном кинофестивале. У актрисы есть и другие кинематографические призы и награды фестивалей класса «Б», а также вторая известная продюсерская работа – криминальный сериал «Линия огня». Сегодня Лесли Бибб активно занимается благотворительностью. Она помогает находить средства для детских домов и фонда «Жизнь». При всей своей загруженности Лесли успевает также участвовать в компаниях бренда Revlon и других крупных медийных и рекламных проектах. 
В 2003 году актриса вышла замуж за банкира Роба Борна.');
Ким Виктория Кэтролл родилась 21 августа 1956 года в британском Ливерпуле. Ее отец был строительным рабочим, а мама – домохозяйкой. Едва малышке исполнилось три месяца, Кэтроллы переехали жить в Канаду. И вернулись в Великобританию, когда Ким уже было 11-ть. «Постоянные переезды родителей заставляли меня все время чувствовать себя чужестранкой в любой среде, — говорит Ким. — И в какой-то момент я осознала, что я не такая, как все девочки. Я с детства не хотела выходить замуж, рожать детей. Я знала, что хочу только одного — играть на сцене». В Туманном Альбионе Ким поступила в Лондонскую академию музыкального и драматического искусства. А затем, следуя своему свободолюбивому сердцу и крутому нраву, в 16 лет в полном одиночестве рванула в Америку, в Нью-Йорк. Там она поступила в Американскую академию театрального искусства и начала строить карьеру. 
Впервые в кино Ким дебютировала в 19 лет. Актриса заключила пятилетний контракт с режиссером Отто Преминджером и снялась в его картине «Бутон розы» (1975). Ким сыграла девушку из высшего общества, дочь богача, чью яхту захватывают палестинские террористы. Спустя год контракт с этим режиссером выкупила киностудия, и Ким стала выступать на телевидении, участвовать в шоу и сниматься в телесериалах. Ким стала довольно востребованной актрисой в Голливуде, снимаясь в нескольких фильмах за год, причем в ведущих ролях. 
Из обилия сыгранных ролей начинающей актрисы наиболее популярной стала роль доктора Габриэль Уайт в сериале «Невероятный Халк» (1978- 1982). Первая популярность пришла к актрисе в 1984-ом, когда 28-летняя Ким Кэтролл воплотила героиню Карен Томпсон, блондинку-курсанта из культовой комедии «Полицейская академия» (1984). Этот фильм имел шумный успех и прославил Ким далеко за пределами Америки. Еще одной успешной актерской работой стала роль в фильме Майкла Готтлиба «Манекен» (1987), где Ким исполнила роль живой куклы, в которую влюбляется главный герой (Эндрю МакКартни). Этот светлый и добрый фильм не только снискал любовь зрителей, в 7 раз окупив свой бюджет в американском прокате, но и удостоился номинации на премию «Оскар». Популярной для Ким стала также и роль лейтенанта Валерис в фильме «Звездный путь 6: Неоткрытая страна» (1991), за которую Ким была номинирована как лучшая актриса второго плана премии «Сатурн», но лауреатом тогда стала другая претендентка. 
Карьера Кэтролл перевернулась в 1997-ом. И хотя Ким к 41 году была вполне известной актрисой, она и не подозревала, что такое настоящий триумф до выхода на экраны телесериала «Секс в большом городе» (1998 – 2004). Этот проект, рассказывающий о личной и глубоко интимной жизни четырех закадычных подруг из Нью-Йорка, без преувеличения покорил весь мир. Ким сыграла в нем самую старшую, самую одинокую, самую чувственную и похотливую подругу Саманту Джонс. Эта героиня принесла Ким не только почитание и любовь миллионов мужчин и женщин, но и ряд престижных кинопремий (что до этой роли с актрисой не случалось). Кэттролл удостоилась «Золотого глобуса», «Эмми», Премии гильдии актеров. Проект имел успех на протяжении шести лет. Но в период съемок Ким находила время и для других проектов. Так, она сыграла вместе с Бритни Спирс в фильме «Перекрестки» (2001). Также Ким написала книги «Досье на сексуальность» и «Найти себя». 
Ким была трижды замужем. Как и у ее героини Саманты, у Ким нет детей.');

Егор Александрович Корешков родился 31 марта 1986 года в Москве в музыкальной семье. Отец будущего артиста выступал в Большом симфоническом оркестре имени Чайковского, мать – вокалистка ансамбля. Сам Егор также имеет образование в этой сфере, окончил музыкальную школу по классу ударных, хотел поступать в экономический университет, но провалил экзамен и устроился в педагогический колледж, который окончил в 20 лет. Сразу после этого решил получить профессиональное актерское образование и стал студентом РАТИ (бывший ГИТИС). Корешков попал в мастерскую Олега Кудряшова. Параллельно с учебой Егор активно занимался музыкой – был барабанщиком в инди-рок-группе «Сара Джессика Паркер». Также он играл на различных сценах московских театров.

В кино Егор начал сниматься еще будучи студентом. В 2008-ом он появился в фильме Валерия Тодоровского «Стиляги» в крошечной роли советского модника. Затем получил незначительные роли продвинутых обаятельных юношей в сериалах «Две сестры 2» (2009), «Только любовь» (2009). Окончив ВУЗ, 24-летний актер поступил в труппу Театра Наций. Корешков совмещал работу в театре и кино. На театральных подмостках Егор выделялся среди других начинающих актеров. Например, принимая участие в фестивале короткометражных спектаклей молодых режиссеров «Театральный альманах», Егор удивительно точно вошел в образ одиозного олигарха Михаила Ходорковского и с чувством декламировал написанное им в тюрьме письмо. Он также дебютировал как режиссер, поставив иронический спектакль над постмодернисткими произведениями: пять минут Егор танцевал чечетку, затем был убит невидимым злодеем, после чего включил в спектакль длиные титры.

Актёрская карьера пошла в гору после знакомства Корешкова с режиссёром Жорой Крыжовниковым. Егор снялся в короткометражке «Счастливая покупка» (2010), где исполнил роль продавца, сбагрившего актрисе Юлии Александровой (супруге режиссера) идеального парня – робота. Впоследствии знакомство с этой творческой группой приведет Егора к всероссийской славе. Настоящая известность пришла к актеру, когда он попал в телесериал «Восьмидесятые» (2011). Корешков присоединился к этому ностальгическому хиту во втором сезоне. Егору досталась лакомая роль – обаятельного, уверенного в себе и очень состоятельного молодого человека Стаса Тихановича – отпрыска влиятельного отца и главного человека молодежной комсомольской ячейки. По словам Корешкова, он изучил множество изданий того времени, что позволило ему выбирать характерные позы, жесты и слова. Фраза «я тебя умоляю», которая стала коронной у Стаса, является импровизацией самого актёра. Следом Корешков сыграл главного героя слезливой мелодрамы «Анечка» (2012) – однолюба Алексея, который отправляется в тюрьму ради любимой девушки.

Несмотря на главные роли в ряде популярных проектов, для тех, кто не смотрит сериалы, имя Егора Корешкова оставалось неизвестным. Ситуация коренным образом изменилась в 2013 году после выхода комедии «Горько!». Фильм с Егором в главной роли неуверенного в себе жениха с успехом выступил в прокате и стал в определённых кругах культовым. В этот проект Корешкова пригласил старый знакомый – режиссёр Жора Крыжовников, а партнершей по фильму стала супруга режиссера Юлия Александрова. Благодаря картине «Горько!» Егора Корешкова стали узнавать на улицах, а его карьера получила новый импульс.

После этого предложения сниматься стали поступать к Корешкову одно за другим. Егору предстояло доказать неслучайность своего успеха у Крыжовникова. Фильм «Братья Ч» (2014), в котором Егор сыграл Антона Палыча Чехова, пришёлся по душе и публике, и критикам. Сиквел «Горько!» (2014) не достиг славы оригинала, зато Корешков блеснул в мотивационной драме «Чемпионы: Быстрее. Выше. Сильнее» (2016), сыграв роль журналиста Яниса. Далее Егор отметился в популярном ситкоме «Отель Элеон» (2016-2017), после чего были «Психологини» (2017-2019) – комедийный сериал о выпускницах психфака и их проблемах с мужчинами. Востребованность Корешкова в те годы сделала бы честь и многим более именитым коллегам, однако главных ролей ему доставалось немного. Нового триумфа пришлось ждать до 2020 года, когда на экранах страны с большим успехом прошёл ещё один комедийный сериал – «257 причин, чтобы жить». Продюсеры вспомнили, каким потенциалом обладает Егор Корешков, и пригласили в состав второго сезона нашумевшего «Метода» (2020-2021). Далее последовал ряд проходных работ, а затем участие в фантастическом сериале «Химера» (2022) по сценарию уже легендарного Олега Маловичко.

