Ференц Дарабонт появился на свет 28 января 1959 года в Монбельяре, во Франции, в лагере беженцев, куда его родители сбежали из Будапешта после Венгерской революции 1956 года. Взросление и детские годы Фрэнка проходили в Америке: сначала – в Чикаго, а потом – в Лос-Анджелесе, где удалось осесть его семье.
Страсть к кинематографу проснулась у Фрэнка после того, как он посмотрел фильм Джорджа Лукаса «Галактика ТНХ-1138» (1971), вышедший на экраны, когда Дарабонту было всего 12 лет. Именно после просмотра этой социальной фантастики Фрэнк воодушевился идеей стать кинематографистом. После окончания средней школы Дарабонт не стал поступать в колледж. Он устроился чернорабочим, работал на погрузчике, а также помощником официанта. В свободное время развивал навыки письма.
В 22 года Фрэнк получил работу ассистента на съемках малобюджетной картины Тома ДеСимоне «Адская ночь» (1981). Последующие шесть лет он работал декоратором и ассистентом художника-постановщика на различных съемках. Одновременно молодой человек пытался найти свой путь в кинематографе. Он пытался писать, а в 24 года создал свою первую короткометражку. Получасовая драма «Женщина в палате» (1983) рассказывает о том, как сын собирается подвергнуть эвтаназии свою тяжелобольную мать. Эта лента была создана на основе произведения Стивена Кинга. Она же и сблизила творцов, которые впоследствии стали добрыми друзьями. Одновременно с этим дебютом Фрэнк помогал писать сценарий в соавторстве с другими писателями к фильму Чака Рассела «Кошмар на улице Вязов 3: Воины сна» (1987). Так, постепенно он начал работать в качество сосценариста на телевидении, а также на картинах Чака Рассела («Капля», 1988).
В 31 год он выступил как режиссер со своей первой полнометражной лентой – телефильмом «Похороненные заживо» (1990). А затем представил совместный со Стивеном Кингом труд – телефильм «Коллекция ночных смен» (1994). Вскоре Кинг продал другу права на экранизацию своего рассказа «Побег из Шоушенка» всего за 1 доллар. Кто мог предполагать, что драма 35-летнего режиссера о борьбе за справедливость, станет одной из популярнейших картин Голливуда за всю историю кино? Выйдя в свет в 1994-ом году, картина впечатлила чуть ли не каждого американца. Лента удостоилась 7 номинаций на «Оскар». А сегодня, спустя два десятка лет, этот фильм держится на 23 месте в сотне самых впечатляющих фильмов всех времен 
от Американского института кинематографии. 
Следом за триумфом режиссер написал сценарии к фильмам «Франкенштейн» (1994), «Молодой Индиана Джонс: Путешествие с отцом» (1996), «Бег черной кошки» (1998). Одновременно с этой работой успел снять еще один шедевр по книге Кинга – «Зеленая миля» (1999) с Томом Хэнксом в главной роли. Эта драма имела такой же успех, что и «Побег…», и заполучила 4 номинации на «Оскар». 
На волне успеха Фрэнка попросили стать режиссером драмы «Мажестик» (2001) с Джимом Керри (лента не окупила бюджета). После работы на ТВ Фрэнк снова взялся за экранизацию Кинга – и представил фильм «Мгла» (2007). В 2010-м году вместе с командой создал сериал о зомби-апокалипсисе «Ходячие мертвецы», который обрел всемирную популярность. 
В 2014 Дарабонт взялся за создание сериала о борьбе полиции с мафиози Микки Коэном «Город гангстеров» (2013) и занялся адаптацией знаменитого произведения Рэя Брэдбери «451 градус по Фаренгейту». Также Фрэнк продюсирует фильмы. ');
Том Хэнкс родился 9 июля 1956 года в городке Конкорд штата Калифорния третьим ребенком в семье повара и официантки. В пять лет мальчик пережил развод родителей, и детство он провел с отцом, ведущим беспутный образ жизни, тогда как мать Том видел лишь по праздникам. Из-за регулярных переездов у него даже не было постоянных друзей. Вопреки тяжелым обстоятельствам, будущему актеру с ранних лет оказалась мила артистическая деятельность, он любил смешить людей и выступать на публике. Уже будучи подростком, Хэнкс играл в школьных спектаклях, поэтому после выпускного поступил на актерский факультет Калифорнийского университета, который он так и не закончил, поскольку получил заманчивое предложение перебраться в труппу городского театра в Кливленде.
Актерская карьера Хэкнса началась в 1977 году, с второплановой роли в пьесе «Укрощение строптивой» для театра, а вскоре Том дебютирует и в большом кино, начав с эпизодического участия в фильме ужасов «Он знает, что вы одни» (1980). Перспективного актера замечают на телевидении, и последующие несколько лет Хэкнс снимается в сериалах, преимущественно комедийных – «Лодка любви», «Счастливые дни», «Семейные узы». Опыт в отыгрывании романтических героев служит Хэнксу добрую службу, поскольку режиссер Рон Ховард приглашает его сняться в главной роли для своей картины «Всплеск» (1984), посвященной трогательной любви мужчины и русалки. Успех окрыляет Хэнкса, и в дальнейшем он снимается в ряде других комедийных картин, неизменно подкупая публику огромным обаянием, артистизмом и самоиронией. Среди фильмов того периода выделяются «Долговая яма» (1986), «Большой» (1988), «Тёрнер и Хуч» (1990).
Настоящая известность и репутация звезды Голливуда приходит к Хэнксу в 90-х, когда он отходит от привычного комедийного амплуа и примеряет драматический образ. Судебно-психологическая драма «Филадельфия» возносит Тома на вершину актерского Олимпа. Хэнкс исполнил роль умирающего от СПИДа гомосексуала, которого несправедливо выгоняют с работы, вынуждая искать справедливости в суде. Блестящая игра самого Хэнкса, взаимодействие с не менее известными коллегами по площадке Дензелом Вашингтоном и Антони Бандерсом превратили «Филадельфию» в современную классику правового кино, а Тому принесли первый актерский «Оскар». Хэнкс развивает успех, и годом позже вызывает еще больший фурор исполнением Форреста Гампа в одноименной трагикомедии Роберта Земекиса. Роль милого аутиста с золотым сердцем, становящегося невольным участником многих ключевых событий в американской истории, становится самой известной и любимой у зрителей в биографии Тома Хэнкса. «Форрест Гамп» разошелся на цитаты, множество сцен фильма стали культовыми, а сам Хэнкс, получив второй «Оскар» подряд, прописался в пантеоне лучших актеров в истории Голливуда.
Уже в ранге одной из самых высокооплачиваемых звезд кино Хэнкс продолжает активно сниматься, причем диапазон его работ впечатляет разнообразием. Многогранному актеру оказываются по плечу любые образы – от командира космического корабля в драме старого знакомца Рона Ховарда «Аполлон-13» (1995) и капитана взвода в военном фильме Стивена Спилберга «Спасти рядового Райана» (1998) до тюремного надзирателя в трогательной экранизации романа Стивена Кинга «Зеленая миля» (1999) и одичалого бродяги в еще одной картине Земекиса «Изгой» (2000). Образы Хэнкса в этих фильмах моментально стали узнаваемыми и всенародно любимыми, особенно персонаж великодушного тюремщика Пола Эджкомба, проникающегося симпатией к несправедливо осужденному верзиле-афроамериканцу Джону Коффи. На излете XX века Том Хэнкс укореняется в звании американского героя, одинаково уважаемого как в профессиональной среде, так и среди рядовых любителей кино.
Новое столетие приносит Хэнксу новые памятные роли. Очередное сотрудничество со Спилбергом обогащает галерею лучших киноработ Тома чудаковатым эмигрантом Виктором Наворски в фильме «Терминал» (2004), застрявшим в аэропорту из-за аннулированной визы, но отказавшимся стать политическим беженцем. Двумя годами позже Хэнкс в фильме «Код да Винчи» воплощает профессора Роберта Лэнгдона – главного героя серии книг Дэна Брауна. Несмотря на специфическую репутацию романа и его адаптации, фильм становится коммерчески успешным, а возвращение к роли Лэнгдона для сиквела «Ангелы и демоны» (2009) приносит Хэнксу фантастический гонорар в 50 млн. $. Хэнкс попадает в «Книгу рекордов Гиннесса», как «актер, сыгравший подряд в наибольшем количестве фильмов, кассовые сборы которых превышают сто миллионов долларов». 
В 2010-х Хэнкс много снимается в различных политических триллерах и драматических картинах, обычно воплощая стойких духом мужчин. Еще дважды Том работает со Стивеном Спилбергом в его фильмах «Шпионский мост» (2015) и «Секретное досье» (2017). Исключительно удачным получается сотрудничество с другим голливудским мастодонтом – Клинтом Иствудом в биографической драме «Чудо на Гудзоне» (2016), где Том отыграл командира аэробуса. В том же 2016-м Хэнкс работает с тезкой Тыквером в картине «Голограмма для короля». Параллельно с регулярными съемками Хэнкс занимается активным продюсированием. Наиболее успешно сложились судьбы мини-сериалов «Братья по оружию» (2001) и «Джон Адамс» (2008), получивших высшую награду для телевизионных проектов «Эмми». ');
Дэвид Морс родился 11 октября 1953 года в городке Беверли штата Массачусетс. Его отец Чарльз работал менеджером по продажам, а мать Жаклин была школьной учительницей. Дэвид рос с тремя младшими сестрами в Гамильтоне, находящемся по соседству с их родным городом. Мальчик изучал актерское мастерство в школе-студии William Esper Studio. Его карьера началась в семидесятых: первое время Дэвид выступал на сцене Бостонского репертуарного театра. На протяжении нескольких лет он увлекался только сценической игрой, но постепенно стал обращать внимание на смежные сферы – кинематограф и телевидение. 
Серьезный карьерный прорыв Дэвида произошел в 1982 году благодаря медицинской многосерийной драме «Сент-Элсвер». Морс предстал в образе Доктора Джека «Бумера» Моррисона, молодого специалиста, чья жена умерла, оставив ребенка ему на попечение. Далее последовал целый ряд ролей второго плана. Сам актер объяснял это так: «Я принял решение не заботиться о том, каков гонорар за ту или иную предложенную роль. Главной задачей было найти роль, которая отличается от того, что я играл ранее». В 1991 году Морс воплотил центрального героя в дебютной режиссерской работе Шона Пенна «Бегущий индеец», а позднее сыграл в трех экранизациях произведений Стивена Кинга: «Лангольеры», «Сердца в Атлантиде» и «Зеленая миля». В 2002 году он появился в детективе китайского режиссера Чэнь Гофу «Двойное видение», за что получил номинацию на премию Golden Horse Awards как «Лучший актер второго плана». В 2007 году Морс снялся в триллере «Паранойя», а один из критиков заметил, что именно благодаря его выразительной игре фильм обрел свою глубину. 
В 2006 году Морсу позвонил Дэвид Шор, сотрудничавший с ним в телепроекте «Таксист» и предложил исполнить гостевую роль в культовом сериале «Доктор Хаус». Актер, к тому времени уже видевший несколько эпизодов, признался, что не разделяет восторгов зрителей и считает главного героя Хауса отвратительным персонажем. Появиться в сериале его убедили одобрительные отзывы друзей и близких. В итоге за исполнение роли Майкла Триттера он получил первую премию «Эмми». В 2008 году актер сыграл Джорджа Вашингтона в минисериале «Джон Адамс», а в 2011-м был удостоен приза на кинофестивале в Карловых Варах за работу в комедии Мартина Донована «Сотрудник». В 2013 году Морс появился в образе пленника заброшенного исправительного учреждения в апокалипсическом фильме ужасов Марка Форстера «Война миров Z».');
Майкл Кларк Дункан родился 10 декабря 1957 года в Чикаго штата Иллинойс, США. Воспитывала Майла и его сестру мать-одиночка, которая выбивалась из сил, чтобы обеспечить двоих детей всем необходимым. Жили трудно и бедно. В детстве будущий актер увлекался американским футболом, но мать запретила ему играть, опасаясь, что сын получит травму. А он мечтал выбиться из нищеты в люди. Майкл сравнительно неплохо учился в школе и даже поступил в Университет Alcorn State University в штате Миссисипи. Однако заболела мама, учебу пришлось оставить и податься на заработки. Он вкалывал на двух работах: днем рыл ямы для компании, поставляющий природный газ, а ночью – вышибалой в ночных клубах, и мечтал, мечтал, мечтал о карьере в кино, за что ему коллеги дали прозвище Голливуд: «Надо мной всегда шутили, когда я рылся в грязи, копая канавы, а они кричали, типа, эй, Большой Майк, Брюс Уиллис на линии, он хочет сделать с тобой фильм, - позже вспоминал Дункан. Все смеялись, а я говорил, знаете, когда-нибудь наступит такой день, и вы будете платить как минимум 8 долларов, чтобы увидеть это лицо, мое лицо, с экрана. И что вы думаете? Так и случилось».
Большой Майк, а он действительно большой – ростом под два метра и весом под 150 килограммов – однажды, работая в одном из ночных клубов Чикаго, познакомился с продюсером телесериалом, который предложил Майклу стать охранником гастролирующей театральной компании. В начале 90-ых Большой Майк перебрался в Лос-Анджелес, лелея надежду прорваться в кино. Но начать пришлось с охраны звезд кино и шоу бизнеса. В частности Майкл работал с актерами Уиллом Смитом, Мартином Лоуренсом, Джейми Фоксом и музыкантом, известным рэпером, Notorious Big. После того, как в 1997 году рэпера убили - он получил пять огнестрельных ранений - Майкл Кларк Дункан завершил свою карьеру телохранителя. Началась другая жизнь, Большому Майку повезло, его пригласили сниматься в рекламе, а далее последовали роли в телесериалах, где он зачастую исполнял роли телохранителей, но это было гораздо безопаснее, чем в реальной жизни.
Большая удача улыбнулась Большому Майку в конце 90-ых. Он получил приглашение сняться в фантастическом боевике «Армагеддон» (1998). Критики фильм восприняли негативно, а у зрителей он прошел на ура – в мировом прокате картина собрала около полумиллиарда долларов. Дуглас сыграл в роль Бугая. Позже актер говорил, что так и не понял, чем приглянулся режиссеру Майклу Бэю, и вообще на прослушивании актер пролил на него воду. На съемках «Армагеддона» произошла судьбоносная встреча Дункана с Брюсом Уилиссом, который позже помог ему получить, возможно, главную роль в его актерской жизни: Брюс познакомил Майкла с режиссером Фрэнком Дарабонтом, который экранизировал мистическую драму по роману Стивена Кинга «Зеленая миля».
В 1999 году «Зеленая миля» вышла на экраны, где Майкл Кларк Дункан сыграл Джона Коффи, добродушного и беззащитного силача, по воле злого рока, незаслуженно приговоренного к электрическому стулу. Эта роль показала, что Дункан – актер, а не только исполнитель типажных ролей больших парней; именно за эту работу его номинировали на премии «Оскар» и «Золотой глобус»: «Я думаю, что самой трудной сценой для меня – это две мертвые девушки в кадре, просто потому, что мне надо было очень много плакать, даже выть, и это меня реально вымотало». Тем временем, кинематографическая дружба с Брюсом Уиллисом продолжилась, и они вместе снялись в фильмах «Завтрак для чемпионов» (1999), «Девять ярдов» (2000), «Город грехов» (2005). Заметные роли Дункан сыграл в фильмах «Планета обезьян» (2001), «Царь скорпионов» (2002), «Сорвиголова» (2003), «Остров» (2005), «Последняя Мимзи Вселенной» (2007), а также Большой Майк озвучивал персонажей в анимационных фильмах. К лету 2012 года у Майкла Кларка Дункана набралась солидная фильмография, а потом, потом случилась трагедия – в середине июня у актера случился инфаркт и остановка сердца. Его девушка Омароса вызвала скорую, а пока та ехала, пыталась привести в чувства Дункана и фактически спасла его на тот момент, но 3 сентября актер скончался. Большой добрый Майк навсегда остался в сердцах любящих его людей и зрителей.');
Известный актер Грэм Грин (не путать с английским писателем) родом из Канады. Он появился на свет 22 июня 1952 года в индейской резервации Сикс-Нейшенс-Резерв, расположенной на территории канадской провинции Онтарио в центральной части страны. Будучи чистокровным индейцем, Грин принадлежит к народу североамериканского племени Онайда, относящегося к группе племен Ирокезов, долгие годы проживающих на американских и канадских территориях. Рожденный в многодетной семье водителя Джона и домохозяйки Лиллиан Грин, Грэм стал вторым ребенком в семействе, фамилию которого в итоге получили шестеро детей. С раннего детства он был воспитан так, что не боялся работы, даже самой тяжелой. Когда актер был шестнадцатилетним подростком, он забросил учебу в школе ради того, чтобы пойти работать. В течение следующих нескольких лет он успел поработать на фабрике, барменом и даже обучился плотницкому делу. В семидесятые годы Грэм Грин резко сменил сферу деятельности и весьма преуспел в качестве звукооператора. Впоследствии он открыл собственную студию звукозаписи в канадском городе Гамильтон, в котором довольно долгое время записывали свои пластинки местные рок-группы. К актерству Грина привел случай. Однажды один из его близких друзей высказал свое мнение о том, что Грэм мог бы стать отличным актером, однако тот отнесся к этому предположению скептически, совершенно не приняв слова друга всерьез. К счастью, друг не стал отступать и еще несколько дней донимал Грина, выдвигая различные аргументы и доводы. Когда же все его попытки заинтересовать будущего актера этой идеей потерпели крах, он пошел на отчаянный шаг, предложив ему сыграть на спор в карты, после Грин, переполняемый духом авантюризма, согласился. Стоит ли говорить о том, что карты легли таким образом, что вскоре киномир узнал актера Грэма Грина. Но прежде он стал выпускником театральной школы «Theatre''s Native Theatre» в 1974 году. Его дебютом на большом экране стала второстепенная роль в китайском боевике 1976 года «Тигр с Севера». Уже несколько лет спустя Грин получил судьбоносное предложение о съемках в спортивной драме начала восьмидесятых годов «Бегущий смельчак», которая и сделала его известным актером. Затем последовала работа на съемочных площадках целого ряда фильмов и сериалов, пока в 1990 году в широкий прокат не вышла приключенческая мелодрама Кевина Костнера «Танцующий с волками», взорвавшая мировую киноиндустрию целым рядом номинаций и побед на всевозможных премиях в области кино, в том числе «Золотой глобус», «Сезар», премии «Британской академии» и, конечно же, «Оскар». Грэм Грин, чья актерская игра в этой картине была отмечена номинацией в категории «Лучшая мужская роль второго плана» моментально стал популярным и востребованным актером. С того момента и по сегодняшний день он исполнил более сотни ролей в фильмах практически всех жанров, начиная от комедий и сериалов и заканчивая серьезными драмами, вошедшими в золотой фонд мирового кино. Самыми нашумевшими фильмами с участием актера и сейчас остаются такие картины, как «Серая сова», «Зеленая миля», «Песнь о Гайавате», «Мэверик», «Вас не догонят», «Казино Джек», «Трансамерика», «Крепкий орешек 3: Возмездие» и «Безоружный».');
Родился 5 ноября 1968 года в Калифорнии. Его родители, актеры Пит Рокуэлл и Пэнни Хэсс, расстались вскоре после рождения сына. Он остался жить с отцом в Сан-Франциско, а к маме приезжал летом на каникулы. Именно благодаря матери он получил свой первый актерский опыт: Сэм вышел на сцену вместе с Пэнни Хэсс, когда ему было 10 лет. Надо сказать, что Рокуэллу богемный стиль жизни понравился не то чтобы с детства, но с подросткового возраста. Учился он неважно, и даже школьный театр, который постоянно предлагал роли талантливому раздолбаю (Рокуэлл сам себя так называет), не смог его удержать в своих стенах. Но тут вмешались родители, и вернули незадачливого тинейджера на учебную стезю. Потом его записали в Высшую школу актерского мастерства Сан-Франциско, и в процессе учебы его пригласили сняться в хорроре «Дом клоунов» (1988). Фильм номинировался на Гран-при жюри фестиваля независимого кино «Сандэнс», а Рокуэлл по окончании учебы перебрался в Нью-Йорк.
 В Нью-Йорке Сэм два года обучался в студии актерского мастерства Уильяма Эспера, играл в театре и потихоньку снимался в кино и телесериалах: «За пределом» (1990), «Закон и порядок» (1990), «Черепашки-ниндзя» (1990), «Мертвецки пьян» (1993). Роли были не главные, театр особых доходов не приносил, поэтом начинающий актер подрабатывал в ресторане. В 1994 году Сэм удачно снялся в рекламе пива, гонорар был достойным и позволили ему не заботиться о подработках, поэтому он решил сосредоточиться только на актерской карьере. После съемок в фильме «Лунная шкатулка» (1996), где он сыграл авантюрного эксцентричного персонажа по имени Кид, Сэма Рокуэлла заметили критики. В драме «Луговые собачки» (1997) он прекрасно сыграл газонокосильщика, который подружился с 10-летней девочкой из богатой семьи в исполнении актрисы Миши Бартон. За эту роль Рокуэлл получил награды в номинации «Лучшая мужская роль» на Монреальском и Калифорнийском кинофестивалях.
Затем режиссер и продюсер Фрэнк Дарабонт пригласил Сэмы сняться в фильме «Зеленая миля» (1999) по мотивам романа Стивена Кинга. Картина была номинирована на «Оскар». Сэм Рокуэлл сыграл маньяка-убийцу по имени Дикий Билл. Вот именно от такой работы, от такой роли, по собственному признанию актера, он получил истинное удовольствие. При этом Сэм философски отмечает, что хотел бы быть характерным актером, но, с другой стороны, хочется также заработать. А так, в идеале, он только бы играл в театре, да снимался в артхаусном кино. «Деньги – это некая власть, которая дает тебе возможность выбирать, – философствует Сэм. – Я сам из Сан-Франциско, и, возможно, однажды осяду там. Но я люблю ЛА (Лос-Анжелес). Мне там прикольно, это забавный город, если в твоих карманах есть деньги. Хороший город».
Пожалуй, самое приметное и яркое кино и у критиков, и у зрителей, с участием Сэма Рокуэлла в главной роли – «Признание опасного человека» (2002), режиссерский дебют Джорджа Клуни, который также сыграл в фильме. Рокуэллу действительно удался его персонаж, Чак Бэррис, человек с двойным дном. В 2003-м году на Берлинском кинофестивале актер получил «Серебряного медведя» в номинации «За лучшую мужскую роль».
Интересная работа в исполнении Рокуэлла представлена в картине «Луна 2112» (2009). Это буквально спектакль одного актера, и этот актер – Сэм Рокуэлл. Картина является полнометражным режиссерским дебютом сына культового музыканта Дэвида Боуи – Данкана Джонса. «Луну» отметило жюри кинофестиваля независимых фильмов «Санденс». И многие считают именно роль в «Луне» лучшей в карьере актера.
Сэм Рокуэлл продолжает играть в театре. Он считает, что именно сцена требует от тебя все, что ты только способен дать. «Я всегда стараюсь работать с лучшими. Когда ты работаешь с тем, кто тебя превосходит, у тебя появляется шанс превзойти самого себя». Пусть актеру на его творческом пути встречаются только лучшие в своей профессии.');
Барри Роберт Пеппер родился 4 апреля 1970 года в городке Кэмпбелл-Ривер в Канаде. Его отец работал дровосеком, а выйдя на пенсию, занялся самостоятельной постройкой пятнадцатиметрового судна, впоследствии названного «Лунный светлячок».
Когда Барри исполнилось пять лет, все семейство Пепперов (мать, отец, Барри и два его старших брата Дуг и Алекс) отправились на «Лунном светлячке» в длительное плавание по водам Тихого океана, останавливаясь в портах Новой Зеландии, Фиджи и Таити. На борту не было телевизора, и Пепперы развлекали себя как могли – разыгрывали сценки, показывали скетчи, устраивали настоящие шоу-представления перед жителями Полинезийских островов. Именно тогда у маленького Барри начали проявляться артистические способности и интерес к исполнительскому искусству. Школьную программу он постигал дистанционно, через переписку с преподавателями, а также нерегулярно посещая различные островные школы.
Через пять лет Пепперы вернулись в Канаду и основали свое собственное дело – открыли магазинчик «Denman Island off Vancouver Island».
После окончания средней школы Барри поступил в один из Ванкуверских колледжей, где некоторое время изучал основы маркетинга и графического дизайна, однако вскоре понял, что его призвание – актерское ремесло, и начал постигать азы лицедейского мастерства в одной из театральных студий.
Впервые зрители увидели Пеппера в 1992 году в канадском телесериале «Горец», после которого на молодого актера как из рога изобилия посыпались интересные предложения по участию в успешных, рейтинговых ТВ-проектах: «Киллер среди друзей», «Мэдисон», «Одинокий голубь», «Параллельные миры», «За гранью возможного», «Девочка Джонни», «Одинокая голубка», «Часовой», «Вайпер», «Титаник», «Мертвая тишина». 
Дебют в большом кино для Барри состоялся с исполнением второстепенной роли в боевике Дина Сэлмера «Огненный шторм». Затем последовали роли в кинолентах маститых голливудских режиссеров, отмеченных многим престижными кинематографическими премиями: «Спасти рядового Райана» Стивена Спилберга, «Враг государства» Тони Скотта, «Зеленая миля» Фрэнка Дарабонта.
После череды карьерных успехов Пеппер потерпел первое профессиональное фиаско – за роль в фантастическом боевике Роджера Кристиана «Поле битвы: Земля» Барри получил премию «Золотая малина» как «Худший актер второго плана». 
После этого досадного случая Пеппер стал более внимательно относиться к выбору ролей, и в последующее десятилетие был задействован лишь в успешных, кассовых проектах, в которых проявил себя как многогранный, талантливый драматический актер: «Вышибалы» Брайана Коппельмана, «Мы были солдатами» Рэндалла Уоллеса, «25-й час» Спайка Ли, «Потерянный в снегах» Чарльза Маритна Смита, «Три могилы» Томми Ли Джонса, «Возвращение мистера Рипли» Роджера Споттиствуда, «5 неизвестных» Саймона Брэнда, «Флаги наших отцов» Клинта Иствуда, «Семь жизней» Габриэле Муччино, «Железня хватка» братьев Коэнов, «Одинокий рейнджер» Гора Вербински и других.
Барри Пеппер является неоднократным номинантом Премии Гильдии актеров и «Золотого глобуса», а также лауреатом премии «Эмми» в категории «Лучшая мужская роль в мини-сериале или телефильме» за роль в сериале «Клан Кеннеди».
Актер счастлив в браке. Вместе с супругой Синди они растят дочь Энналайз.');
