Родился 10 ноября 1966 года в Брянске. Окончил Центральную детскую музыкальную школу и Театральное училище имени Бориса Щукина, курс Юрия Катин-Ярцева и Владимира Поглазова. 
Работал во многих театрах Москвы: театре имени Вахтангова, Московском театре юного зрителя, театре Содружество актеров Таганки, театре Комедии Алексея Кирющенко и в Театральной компании Сергея Виноградова. Борис сыграл в большом количестве классических постановок, но нельзя не отметить одну его нестандартную роль. В театре «Практика» он играет народного депутата в спектакле «Коммуникатор», и на протяжении всего спектакля Каморзин находится на сцене абсолютно голый. 
Борис начал свою карьеру в конце 90-х, если не считать небольшую роль в фильме «Облако-рай» 1990 года. Ему часто давали эпизодические роли, но актера это не расстраивало. Каморзин часто мелькал на экранах то в художественном кино, то в сериалах. В 2004 году он получил одну из лучших своих ролей в драме Сергея Урсуляка «Долгое прощание». По сюжету фильма его герой – обеспеченный драматург по фамилии Смолянов, который влюблен в молодую замужнюю актрису. За эту работу Каморзин получил приз Гильдии кинокритиков и кинопрессы России в номинации «Лучшая мужская роль второго плана». 
В 2009 году Борис сыграл в фильме «Сказка про темноту» Николая Хомерики. Эта работа была также отмечена критиками: за роль Димыча он получил приз в номинации «Лучшая мужская роль» на «Кинотавре- 2009». Следом режиссер Владимир Котт пригласил Каморзина на одну из главных ролей в свой фильм «Громозека». Актер играет милиционера по фамилии Громов, который решает вместе со своими школьными товарищами тряхнуть стариной. Впоследствии Владимир Котт снял Бориса в своем фильме «На дне», вышедшем в 2014 году. Также Каморзин сыграл небольшую роль партийного босса Фрола Козлова в биографичном сериале «Фурцева. Легенда о Екатерине» Сергея Попова. Главную героиню играет давняя подруга актера Ирина Розанова, с ней он познакомился на съемках своего первого фильма «Облако-рай» в 1990 году. Стоит также отметить роль Гладкова в детективном сериале «Хмуров» Сергея Коротаева. 
Каморзин женат и с удовольствием рассказывает о своем романе с женой: «Светлана – мой помощник и агент. Мы уже семнадцать лет в браке, сыну Борису – шестнадцать лет. Познакомились в ТЮЗе, где она работала администратором. Случилось все, когда я решил вернуться туда из Театра Вахтангова. Света оказалась первой, кто выбежал мне навстречу, и очень обрадовалась решению снова поступить в труппу. Я тут же купил ей мороженое, вечером проводил ее до дома, где и остался».
Каморзин – востребованный актер, он сыграл более семидесяти ролей и продолжает сниматься по настоящее время.');
Отец Романа, Сергей Вениаминович, был режиссером и работал на телевидении. Он часто брал сыновей на работу (младшего Романа и старшего Вадима). Именно здесь ассистенты режиссера и обратили внимание на юное дарование и будущего артиста. 
Романа пригласили сняться в кино в 1971 году в эпизодической роли школьника в драме «Перевод с английского». А уже в 1973 году Роман Мадянов исполнил главную роль в приключенческом фильме «Совсем пропащий», который был снят режиссером Георгием Данелией по мотивам книги Марка Твена. Роман удостоился сыграть роль Гекльберри Финна. 
Будучи школьником, Мадянов снялся в нескольких картинах. Это такие фильмы, как «Все дело в брате», «Весенние перевертыши» и «Анискин и Фантомас». 
Роман Мадянов поступил в Государственный институт театрального искусства на курс О. Я. Ремеза. Его дипломной работой стала роль в спектакле, поставленном режиссером Камой Гинкаса. 
Когда Мадянов был еще студентом, он вошел в труппу Московского театра им. Маяковского. После окончания университета актер отправился в армию, но после возвращения в 1987 году решил снова работать в театре. 
В Московском театре имени Маяковского Роман Мадянов проработал около 20 лет. За это время он успел сыграть около 30 ролей. Самыми популярными спектаклями, в которых был задействован Мадянов, стали «Театральный романс», «В кольце тишины», «Жертва века», «Наливные яблоки, или Правда - хорошо…», «Закат», «Розенкранц и Гильденстерн мертвы», «Банкрот», «Валенсианские безумцы», «Горбун», «Дети Ванюшина». 
В 1989 году Роман Мадянов продолжил сниматься в кино. Его фильм-возвращение - «Частный детектив, или Операция Кооперация», снятый Л. Гайдаем. С этого момента актер стал постоянно появляться в телевизионных сериалах и кино. Кроме того, Мадянов принял участие в съемках нескольких серий популярного юмористического киножурнала «Ералаш», а также нескольких рекламных роликов. 
1995 год оказался для актера значимым. Он получил звание «Заслуженный артист Российской Федерации». Говоря о наградах, стоит отметить, что за свою жизнь Мадянов был трижды номинирован в категории «Лучшая мужская роль второго плана» на премию «Ника». 
Когда Роман Мадянов только начал работать в Московском театре им. Маяковского, он встретил свою будущую спутницу жизни. В 1992 году влюбленные решили сыграть свадьбу, а уже на следующий год у пары появился сын Роман.');
Никита Борисович Тарасов появился на свет 3 декабря 1979 года в Риге. А вырос в Москве. Его отец – музыкант и композитор, а мать – инженер-конструктор. Отец прививал сыну любовь к музыке чуть ли не с пеленок. Уже в старших классах Никита трудился ди-джеем на радио и писал собственные музыкальные композиции. В актерскую профессию Никиту забросил случай. Однажды выпускник прочитал объявление в газете о наборе студентов в Школу-студию при МХАТ на курс Олега Табакова. Никита решил пойти – и ему удалось без подготовки поступить к Табакову с первого раза.
Еще студентом Тарасов начал играть на театральных подмостках и сниматься в кино.
Его первые работы были в сериалах «Леди Босс» (2001), «Русский водевиль. Бедовая бабушка» (2001), «Главные роли» (2002). 
«Наш руководитель Олег Табаков запрещал студентам участвовать в кино, поэтому я тайно убегал на съемочную площадку. Одна из первых моих картин – исторический водевиль «…Бедовая бабушка». Я считаю, что это знаково, – рассказывает Никита. – В этом фильме я играл еще будучи второкурсником Школы-студии МХАТ.. Моими партнерами были Александр Линьков, Альберт Филозов и еще некоторые известные актеры. Собралась такая звездная команда, на фоне которой я выглядел бедным, голодным, замученным студентом. Но работа с мастерами дала мне ощущение профессии и исторического прошлого страны».
В 2002 году 22-летний актер удостоился номинации на премию «Дебют года» за роль Эпштейна в дипломном спектакле «Билокси-блюз». После окончания театрального Никита поступил на службу в театр РАМТ, затем перешел в Московский Драматический Театр им. К. С. Станиславского. Одновременно Никита активно снимался в кино и на ТВ. И пока актер мечтал сыграть «про любовь», режиссеры давали ему роли то вампира, то наркомана, то хакера, то убийцы, то трансвестита. Впрочем, со временем актеру удалось сыграть и светлые чувства – в телесериале «Одна ночь любви» (2007).
Одной из ярких ролей в фильмографии актера стал Олег Политов из мелодраматического сериала «Широка река» (2008). Другой яркой ролью был журналист, зав. отдела культуры в редакции в фильме «Первая попытка» (2009). Однако массово прославила 33-летнего актер роль французского повара-кондитера по имени Луи в рейтинговом сериале телеканала СТС «Кухня» (2012). Никита воплощает комедийную роль эксцентричного любителя мужчин, который превосходно готовит десерты в одном известном московском ресторане, о жизни которого и повествует «Кухня». Сериал имел отличные рейтинги в России, благодаря чему актер Тарасов прославился по всей стране. К слову, режиссеры часто видят в Никите Тарасове образы несколько нелепых мужчин. Так, авторы Наталья Меркулова и Алексей Чупов пригласили Никиту на роль рефлексирующего по поводу своей сексуальной активности мужчины в комедию «Интимные места». Вместе с этой ролью к актеру пришел громкий фестивальный успех. Ведь фильм об отношениях мужчин и женщин в современном обществе, о комплексах и последствиях сексуальной неудовлетворенности, прогремел на «Кинотавре», завоевав множество призов. Никита Тарасов исполнил в этой комедийной драме ведущую роль – мужа-неудачника, который потерял интерес к жене, боится ей изменить, но, тем не менее, постоянно ходит по улицам в поисках страшных дам, чье уродство, по его мнению, поможет ему вернуть очарование миловидной женой. Следом режиссер Елена Кузнецова пригласила актера на главную роль в свою ленту «Кукушен».');
Михаил Крылов родился 4 марта 1974 года в Тверской области, в поселке Вышний Волочек. Еще в школе Михаил решил, что станет актером, и на вопросы учителей твердо об этом заявлял. Впрочем, Михаилу особо не верили. Однако после окончания школы он поехал в Москву, где ему удалось поступить в ГИТИС на курс Петра Фоменко.
Будучи студентом, Михаил дебютировал в кино, в 1995-ом году вышла в свет короткометражная комедийная драма производства Греции «Мост», где он сыграл второстепенную роль.
Окончив вуз в 1997-ом, Крылов начал активную театральную карьеру. В основном актер играл на подмостках «Мастерской Петра Фоменко».
Его полноценный актерский дебют состоялся в полнометражном фильме «Мама» Дениса Евстигнеева в 1999-ом году. Режиссер знал Михаила еще по предыдущей работе в «Русском проекте», поэтому позвал его на одну из ведущих ролей в «Маму». Картина принесла Крылову первый громкий успех. Это мелодрама рассказывает известную историю одной советской женщины, которая одна растила шестерых детей, организовала музыкальный ансамбль, однако отчаяние и нищенское существование толкнули ее на рискованный шаг - угнать самолет за границу и обеспечить своим детям достойное будущее. План сорвался, мать попала тюрьму, но вышла оттуда спустя 15 лет и собрала детей, чтобы вызволить сына из психушки. В этой нашумевшей картине с Ноной Мордюковой в главной роли Михаил сыграл одного из ее сыновей - Юру. В том же году Крылов закрепил свою узнаваемость ролью Сереженьки в триллере Николая Лебедева «Поклонник» (1999). И тогда же актер снялся у Алексея Германа мл. в его короткометражке «Большое осеннее поле» в главной роли.
В 2000-ом году Крылов дебютировал как театральный режиссер - он поставил спектакль «Евгений Онегин. Пушкин», который спустя шесть лет воскресил в театре под другим именем - «Онегин@точка.ru». В своем же спектакле Михаил играет сразу несколько ролей - и Ленского, и Онегина.
В театре Михаил довольно скоро стал ведущим актером. Он играет в моноспектакле «Дикарь, в защиту пещерного человека», исполняет роль главврача Канашникова в постановке «Чапаев и пустота» вместе с Михаилом Ефремовым и прочих постановках.
В 2003-ом году Михаил Крылов появился в небольшой роли в ленте Алексея Учителя «Прогулка». Массовую известность ему также принесла работа в телесериалах: «Медики» (2002), «Штрафбат» (2004), «Дальнобойщики 2» (2004), «Есенин» (2005), «Завещание Ленина» (2007), «Котовский» (2009).
В 2008-ом году Михаил Крылов появился на экранах в комедии «Гитлер капут!». В этой ленте он блестяще сыграл роль Адольфа Гитлера, показав его смешным и даже комически обаятельным персонажем, что прибавило ему немало популярности среди массового зрителя.
В 2012-ом году Михаил стал героем романтической комедии Александра Рогожкина «Афроiдиты», где перевоплотился во владельца сетей отелей на Кипре. А на телеэкранах он возглавил актерский состав сериала «Темное царство», снятого по пьесам Островского.
Вскоре актер появился в дебютной ленте Сергея Тарамаева «Зимний путь», снятой в соавторстве с Любовью Львовой. Фильм рассказывает о терниях на пути к успеху талантливого певца.
Следом актер мелькнул в комедии «Что творят мужчины!» (2013). А затем присоединился к комедии Натальи Кудряшовой «Пионеры-герои» (2014), посвященной поколению сегодняшних 30-летних граждан, потерявших смысл жизни.');
Владимир Капустин – российский актер театра и кино. Родился 16 марта 1971 года в городе Ангарск Иркутской области.', NULL);
Родилась 8 декабря 1953 года в штате Джорджия. Ее мать была манекенщицей и солисткой водного шоу-балета, а отец работал финансовым консультантом, играл в джазовой группе. У Ким два старших брата и две младших сестры. В семнадцатилетнем возрасте она выиграла местный конкурс красоты и отправилась в Нью-Йорк. Бейсингер снималась в рекламных роликах, работала моделью и играла в любительских спектаклях. Через какое-то время она в поисках лучшей жизни переехала в Калифорнию.
Начинающую актрису приглашали в телевизионные фильмы на эпизодические роли: она отметилась в сериалах «Ангелы Чарли», «Вегас», «Отныне и вовеки веков», «Человек на шесть миллионов долларов» и в фильме «Призрак рейса 401». Вскоре ей уже досталась ключевая роль в телевизионной ленте «Портрет очарования». Первой значительной работой на большом экране стала картина «Суровая страна» (1981). Однако карьера Ким развивалась медленно. Когда она снялась обнаженной для журнала «Плейбой» и привлекла всеобщее внимание, количество приглашений в в новые проекты резко возросло. В последующие годы актриса отметилась в таких фильмах, как «Убить Джой», «Золотая жила», благодаря которым набрала определенную популярность, затем сыграла вместе с именитым Рейнолдсом в ленте «Мужчина, который любил женщин».
Еще больший успех Бейсингер принесло участие в одной из серий бондианы «Никогда не говори “никогда”» в 1983-м году, затем она сыграла в фильмах «Самородок» и «Без ума от любви». В 1985 актриса буквально проснулась знаменитой после выхода на экраны эротической мелодрамы «9 1/2 недель», которая стала культовой. В последующие годы на волне популярности Ким появилась в фильмах «Без пощады» с Ричардом Гиром, «Свидание вслепую» с Брюсом Уиллисом, «Надин», «Моя мачеха инопланетянка» с Алеком Болдуином, «Бэтмен» с Майклом Китоном, «Привычка жениться», «Окончательный анализ», «Настоящая Маккой», «Мир Уэйна 2» и «Высокая мода».
В этот период актриса развелась с продюсером Роном Бриттеном. На съемках картины «Привычка жениться» у нее завязался роман с Алеком Болдуином. Пара поженилась в 1993 году. Через год они вместе сыграли в ленте «Побег», ремейке одноименного фильма 1972-го года, после чего в актерской карьере Бейсингер наступил перерыв, связанный с рождением ребенка. Возвращение, состоявшееся в мелодраме 1997-го года «Секреты Лос-Анджелеса», было ознаменовано премиями «Оскар» и «Золотой глобус». Несмотря на феерический успех, Ким не стала вести активную актерскую деятельность и в среднем бралась в год за пару проектов, а порой подолгу не соглашалась ни на какие роли. В 1999 году Бейсингер рассталась с Болдуином, бракоразводный процесс оброс всевозможными слухами.
В 2000-е с участим актриса вышли ленты «Я мечтала об Африке», «Спаси и сохрани», «8 миля», «Нужные люди», «Элвис покинул здание», «Дверь в полу», «Сотовый», «Охранник», «Крупная ставка», «Пылающая равнина» и «Пока ее не было». Среди последних работ Бейсингер можно отметить мелодраму «Двойная жизнь Чарли Сан-Клауда» и драму «Черный ноябрь», которая выходит в 2012 году.');
Родилась 10 ноября 1977 года в Атланте, штат Джорджия, США. Ее мать звали Шэрон Мерфи, отца Анджело Бертолотти. Через пару лет после ее рождения, родители развелись. Бриттани осталась с матерью. С детства она подавала большие надежды, как рассказывает в одном из своих интервью: «Я начала говорить в полгода, петь в год, читать в три, а заниматься актерской деятельностью и продавать кухонную посуду в девять. У моей мамы был договор с компанией-производителем на продажу их посуды, а я помогала ей по личной инициативе – обзванивала потенциальных заказчиков, благо, что у меня был невысокий голос». В возрасте девяти лет девочка начала выступать в местном театре в Джорджии, а тринадцать уже снималась в рекламе. В этом же возрасте они с матерью переехали в Калифорнию, где Бриттани начала получать свои первые роли.
Зрителям Бриттани Мерфи запомнилась и полюбилась после выхода в 1995 году фильма «Бестолковый» режиссера Эми Хекерлинг. В этом фильме она сыграла взбалмошного подростка по имени Тай, лучшую подругу главной героини. В 1999 году снялась вместе с Анджелиной Джоли в драме «Прерванная жизнь». А 2001 году вместе с Майклом Дугласом появилась в фильме «Не говори ни слова». В обоих картинах ей достались роли пациентки психиатрической клиники. В 2002-м поклонники репера Эминема могли насладиться игрой актрисы в биографическом фильме «8 миля», где Бриттани сыграла подружку главного героя. 
Актриса часто получала главные роли. Но в фильмах, где ей доставались второстепенные персонажи, она все равно обращала на себя немалое внимание зрителей за счет своего обаяния. Актрису брали на съемки совершенно не похожих друг на друга фильмов, она на ура справлялась с ролями в любовных комедиях и отлично играла сложных драматических и криминальных персонажей. Помимо кино Бриттани также часто участвовала в телевизионных проектах, в начале карьеры она снималась в основном в сериалах. В 2008 году Мерфи выступила сопродюсером фильма «Суши girl» Робера Аллана Акермана, где также сыграла главную роль.
У Мерфи отличный голос, в начале своей актерской карьеры она была солисткой группы «Blessed Soul». Ее песни стали саундтреками к фильмам «Прерванная жизнь» и «Прогулки с парнями на автомобилях». Также она выступила вокалисткой в треке Пола Окенфолда «Faster Kill Pussycat».
Личная жизнь Бриттани была полна романами с известными актерами. Но под венец ее взял сценарист Саймон Монджека в 2007 году. 
20 декабря 2009 года актриса скончалась в собственной ванне, дома в Лос-Анджелесе. Причина смерти до конца не ясна: по одним данным это сердечная недостаточность, по другим пневмония, также есть версия, что актрису отравили. Похоронили Бриттани на Голливудских холмах 24 декабря 2009 года. Через пять месяцев скончался ее муж. 
Мерфи обладала невероятно очаровательной улыбкой и харизмой. Ее любили не только за актерский талант: многие звезды Голливуда, такие как Элайджа Вуд, бывший бойфренд Эштон Катчер, Джессика Симпсон, отзывались о ней, как об очень хорошем и добром человеке.');

Бекмамбетов родился 25 июня 1961 года в городе Гурьев в Казахской ССР, его отец, Нурбахыт Бекмамбетов, был одним из руководителей на городском энергетическом предприятии, а мать, Мира Богословская, работала в должности заместителя редактора партийной газеты. После окончания школы Тимур поступил в Московский энергетический институт: отец прочил сыну карьеру энергетика. Вскоре Бекмамбетов увлекся искусством и бросил ВУЗ. Затем последовала служба в армии. В 1982 году Тимур приступил к работе на киностудии «Узбекфильм» в Ташкенте. Примерно в это же время он поступил в Ташкентский театрально-художественный институт им. А. Островского, где выбрал специальность «художник театра и кино». Во время учебы Тимур познакомился и подружился с начинающим актёром Виктором Вержбицким. Это знакомство впоследствии переросло в длительное сотрудничество и стало плодотворным для обоих. 

После окончания института Тимур был готов вовсю применять полученные знания на практике. Местом профессиональной деятельности он сразу выбрал столицу. В 1987 году Бекмамбетов переехал в Москву. Одним из стремительно развивающихся направлений в это время стало производство рекламных роликов. Бекмамбетов вовремя усмотрел зарождающиеся тенденции и приступил к рекламным съемкам. Одним из первых проектов стал сюжет о банке «Кредит-Москва», за ним последовали ролики для банка «Менатеп». Настоящим триумфом стал 1992 год, когда на экранах телевизоров появились первые впечатляющие костюмированные рекламные ролики банка «Империал». На протяжении пяти лет Бекмамбетов принимал участие в создании нескольких рекламных сюжетов, объединённых общей концепцией. Серия «Всемирная история, Банк Империал» сразу была замечена зрителями и получила большинство наград на фестивалях рекламы не только в России, но и за рубежом. Некоторые роли в роликах исполнил Вержбицкий. Закадровыми голосами стали титаны отечественного кинематографа Иннокентий Смоктуновский и Владимир Машков. После этого триумфа Тимур был избран членом Российской академии рекламы. 
Дебютом в кинематографе для Бекмамбетова стала военная драма 1994 года «Пешаварский вальс». Бекмамбетов принял участие не только в режиссуре, но и стал соавтором сценария картины. Лента максимально реалистично отображала события Афганской войны и была горячо встречена кинокритиками. Она обошла несколько престижных фестивалей и собрала ряд наград, включая главную премию на МКФ в Сан-Ремо. 
В 2000 году Бекмамбетов стал режиссером восьмисерийного исторического телевизионного проекта «Наши 90-е», рассказывающего историю о трех мужчинах в смутные времена. Зрители так и не увидели эту работу: в 1998 году лента была запрещена к показу. В 2001 году Бекмамбетов стал режиссером малобюджетного исторического американо-российского боевика «Арена». Следующим проектом стал документальный сериал «ГАЗ. Русские машины: Дорога длиною в 70 лет», рассказывающий невероятные истории о людях и их автомобилях. 
Кинематографический успех пришел к режиссеру в 2004 году, когда на экраны вышел фантастический фильм «Ночной дозор», снятый по одноимённому роману Сергея Лукьяненко. Главные роли исполнили Константин Хабенский, Владимир Меньшов и Виктор Вержбицкий. Продюсером картины выступил генеральный директор «Первого канала» Константин Эрнст. Фильм имел оглушительных успех у зрителей и был показан в России, странах СНГ, Великобритании, США и Германии. В следующем году свет увидел сиквел «Дневной дозор». 
В 2007 году Бекмамбетов стал режиссером лирической комедии «Ирония судьбы. Продолжение». В 2008 вышел боевик «Особо опасен». Главные роли исполнили Джеймс Макэвой, Морган Фриман, Константин Хабенский и Анджелина Джоли. 
В 2012 году зрители увидели очередную голливудскую работу Бекмамбетова фантастический триллер «Президент Линкольн: Охотник на вампиров». ');
Родился 14 января 1963 года в Атланте, крупнейшем городе штата Джорджия. Его родителями были мать Мэри-Энн, урожденная Бернард, и отец Питер Эндрю Содерберг, работавший в университете в качестве педагога и администратора. Предки Эндрю по отцовской линии были иммигрантами из Швеции. Еще когда мальчик был совсем маленьким, семья оставила Атланту, и переселилась в Шарлоттсвилль, штат Вирджиния. Здесь прошло все детство Содерберга. Позднее они снова переехали. На сей раз их домом стал Батон-Руж, в штате Луизиана. В этом городе Питер получил должность декана в местном Университете. В это время Стивен увлекся киноискусством и совершил свои первые видеосъемки с помощью камеры, позаимствованной у студентов. Мать мальчика в это время часто появлялась на экранах местного телевизионного канала. 
Первоначально Содерберг поступил на обучение в школу при Университете Луизианы. Несмотря на то, что в возрасте пятнадцати лет он еще не был студентом, Стивен уже поступил на курсы аниматоров при университете. Там же он начал снимать свои ранние работы на 16 мм пленку. Затем, вместо того, чтобы стать студентом и получить высшее образование, он бросил обучение и отправился на поиски счастья в Голливуд. Первое время молодой человек едва мог свести концы с концами, пока наконец ему не удалось получить более или менее достойную постоянную работу внештатного режиссера. Прорыв в карьере Содерберга произошел в 1985 году, после того, как он руководил съемкой концертного видео для рок-группы Yes. Эта работа получила номинацию на премию «Грэмми». В 1989 году состоялся его дебют в полнометражном кино. Драма «Секс, ложь и видео» рассказывала сложную историю о взаимоотношениях отчаявшихся мужчины и женщины. Сценарий для съемок был написан Содербергом всего лишь за восемь дней. Роли в драме исполнили Энди Макдауэлл и Джеймс Спейдер. Лента быстро получила статус культовой, внесла большой вклад в революцию независимого кинематографа и имела большой коммерческий успех. На Каннском фестивале лента была удостоена «Золотой пальмовой ветви» — Стивен стал самым молодым победителем и значимым открытием. 
В 1991 году Содерберг создал новую работу – драму «Кафка», рассказывающую хитросплетенную историю, состоящую из вымышленных мистических и биографических фактов. Главную роль в фильме исполнил Джереми Айронс. В 1998 году на экраны вышла коммерчески успешная криминальная комедия «Вне поля зрения» с Джорджем Клуни и Дженнифер Лопес в главных ролях. Через два года режиссер создал еще одну нашумевшую картину – байопик «Эрин Брокович». Главную роль в нем исполнила Джулия Робертс, которая получила «Оскар» за работу. В 2000 году Стивен поставил триллер «Траффик», исследующий систему оборота наркотиков, всевозможные проявления наркотической зависимости и ее последствия. Проект имел оглушительный успех и вызвал большой резонанс в обществе. Лента была удостоена множества престижных кинематографических премий, в том числе получила четыре статуэтки «Оскар», две премии BAFTA и премию «Золотой глобус». 
Через год режиссер взялся за работу над приключенческой криминальной комедией «Одиннадцать друзей Оушена». В фильме была задействованы Джордж Клуни, Бред Питт, Мэтт Деймон, Джулия Робертс. Сам Содерберг исполнил небольшую роль грабителя сейфов. Фильм собрал в прокате 450 миллионов долларов и впоследствии породил несколько сиквелов. В 2002 году Стивен предложил зрителям свое прочтение повести Станислава Лема «Солярис», экранизированной ранее Андреем Тарковским. Одним из продюсеров ленты выступил Джеймс Камерон. Затем режиссер создал биографический фильм «Че», триллер «Информатор», фильм-катастрофу «Заражение». В 2012 году зрители увидели новую работу Содерберга — мелодраму «Супер Майк» с Ченнингом Татумом в главной роли. ');
Родилась 22 июня 1949 года в штате Нью-Джерси. Ее отец работал в фармацевтической компании, а мать была художницей. В детстве будущую актрису воспитывали в строгих религиозных традициях, однако не вполне успешно, например, ее исключили из воскресной школы за плохое поведение. Родители также наняли для дочери учителя пения и всячески приветствовали любые творческие начинания. В возрасте пятнадцати лет Мэрил перекрасилась в блондинку. Первые успехи на сцене она начала делать в колледже, после окончания которого поступила изучать драматическое искусство в Йельский университет. Учебу она совмещала с работой художника по костюмам в летних театрах.
В 1975 году Мэрил окончила университет, и ей почти сразу предложили основную роль в постановке «Око за око». Стрип успешно работала в одном из лучших театров Нью-Йорка в течение нескольких лет, после чего решила обратить внимание на мир кино. Несмотря на театральные успехи, путь к большому экрану пришлось начинать с эпизодической роли в драме «Джулия». В том же 1977 году с ее участием вышли ленты «Тайная служба» и «Самый смертоносный сезон», а уже в 1978-м Мэрил добилась значительных успехов в кино: она снялась в картине «Охотник на оленей» и номинировалась на премии «Оскар» и «Золотой глобус». Кроме того, за роль в мини-сериале о войне «Холокост» она получила «Эмми». В последующие годы карьера Стрип развивалась стремительно. С ее участием вышли фильмы, высоко оцененные как критиками, так и зрителями, и отмеченные престижным премиями, в том числе «Оскаром» и «Золотым глобусом»: «Манхэттен», «Соблазнение», «Крамер против Крамера».
Популярность Мэрил росла, и в последующие годы она сыграла в лентах «Женщина французского лейтенанта», «Выбор Софии», которая принесла очередного «Оскара», «Силквуд», «Влюбленные», «Из Африки», «Беспокойное сердце», «Чертополох», «Дьяволица». Стрип стала самой известной и успешной актрисой Голливуда. В 80-х годах она появлялась и в новом для себя амплуа – комедийном. Большинство проектов с ней были тепло приняты зрителями и критиками, многие отмечены престижными наградами или номинациями. Среди фильмов периода 90-х годов можно отметить ленты «Открытка с края бездны», «Защищая твою жизнь», «Смерть ей к лицу», «Дом духов», «Дикая река», «Мосты округа Мэдисон», «Комната Марвина», «Танцы во время Луназы», «Истинные ценности», «Хризантемы», «Музыка сердца».
Несмотря на множество удачных работ, по мнению критиков, одну из своих лучших ролей Стрип исполнила в 53 года в драме «Часы», которая вышла на экраны в 2002 году и была награждена значительным числом кинопремий. «Адаптация», мини-сериал «Ангелы в Америке», «Мой лучший любовник», «Дьявол носит Prada», «Темная история», «Львы для ягнят», «Капитуляция», «Вечер» – наиболее яркие картины 2000-х с участием актрисы.
На протяжении всей своей длительной и плодотворной карьеры Стрип демонстрировала высочайший уровень мастерства. Среди ее работ последних лет можно отметить такие популярные фильмы, как «Мамма MIA!», «Сомнение», «Джули и Джулия: Готовим счастье по рецепту», «Простые сложности», «Железная леди» и «Весенние надежды».
Всего на счету Стрип 17 номинаций на премию «Оскар» – рекорд в истории кинематографа. Она активно участвует в общественной деятельности и занимается благотворительностью. С 1978 года Мэрил состоит в счастливом браке со скульптором Доном Гаммеро, у нее четверо детей. В настоящее время актриса проживает на своем ранчо в Коннектикуте и продолжает сниматься в кино.');
Родился 13 декабря 1996 года в Бруклине, в семье поэтессы и актрисы Сьюзан Брюс Титман и номинанта на премию «Оскар» (за сценарий к фильму «Мой мальчик») сценариста и режиссёра Питера Хеджеса. У него есть старший брат Саймон. 
