Кэндис Патрисия Берген появилась на свет 9 мая 1946 года в Лос-Анджелесе, штат Калифорния. Ее мать Фрэнсис Берген, более известная как Фрэнсис Уэсткотт, была моделью одного из первых в мире модельных агентств – нью-йоркского модельного агентства Джона Пауэрса. Ее отцом был известный американский чревовещатель, комик и актер Эдгар Берген. Ее дедушка и бабушка были шведскими эмигрантами, настоящая фамилия которых звучала как «Бергрен». 
Кэндис начала появляться на радиопередачах своего отца еще в дошкольном возрасте, хотя в детстве девочка мечтала стать модным дизайнером. Берген поступила в Пенсильванский университет, где стала мисс Университет, но так и не получила образование, в связи с активно развивающейся модельной карьерой. Лишь только в зрелом возрасте, в 1992 году, Берген получила докторскую степень.
На большом экране Кэндис дебютировала в 1966 году в драме о жизни частной школы «Группа». За ней последовала работа в военной драме «Песчаная галька», комедии «День, когда всплыла рыба», драме «Жить, чтобы жить», боевике «Искатели приключений», детективной драме «Маг», мелодраме «Напрямик», вестерне «Солдат в синем мундире», драме «Познание плоти», вестерне «Охота», драме «Т. Р. Баскин», комедии «Похитители бриллиантов», боевике «Ветер и лев», триллере «Принцип домино», боевике «Прикуси пулю», драме «Конец света в нашей супружеской постели однажды дождливой ночью», мелодраме «История Оливера», мелодраме «Начать сначала», драме «Богатые и знаменитые», мелодраме «Король Артур», биографической драме «Ганди», триллере «Стик», драме «Мадам Мэйфлауэр».
В последние годы Берген снялась в мелодраме «Мэри и Тим», комедии «Мисс Конгениальность», мелодраме «Стильная штучка», комедии «Свадебная вечеринка», мелодраме «Вид сверху лучше», триллере «След», мелодраме «Секс в большом городе», драме «Женщины», мелодраме «Война невест», драме «Романтики».
Кроме того, Кэндис принимала участие в съемках таких многосерийных картин как «Маппет-шоу», «Голливудские жены», «Мерфи Браун», «Сайнфелд», «Закон и порядок», «Секс в большом городе», «Юристы Бостона», «Закон и порядок: Суд присяжных», «Шоу Майкла Дж. Фокса».
Берген является политической активисткой, она работала вместе с известным американским государственным деятелем и дипломатом Генри Киссинджер, а также для президентской компании Джорджа Макговерна. 
Берген и ее бывший гражданский муж, музыкант Терри Мелчер, жили на вилле, проданую впоследствии Роману Полански и Шэрон Тэйт, которую, вместе еще с троими людьми, убили последователи Чарльза Мэнсона в этом самом доме. 
В 1980 году Кэндис вышла замуж за французского кинорежиссера Луи Маля, но в 1995 году Луи скончался от рака, у пары есть общая дочь Хлоя. 
На данный момент Берген замужем за нью-йоркским миллионером, владельцем риэлтерской империи, Маршаллом Роузом. ');
Крэйг Гиллеспи – австралийский режиссер, которого все знают и уважают за способность показать великолепную игру актёров, используя нестандартные комедийные приемы. Также снимает рекламные ролики.', '


Работы, в которых Гиллеспи балансирует между комедией и обыденностью, отличаются особой тональностью. Общие кассовые сборы его картин превысили 240 миллионов долларов. В его фильмах была задействована целая плеяда талантливых актёров: Райан Гослинг, Колин Фарелл, Крис Пайн, Кейси Аффлек, Джон Хэмм, Тони Коллетт, Марго Робби, Эмма Томпсон и Эмма Стоун. 


«Тоня против всех», одна из последних работ Гиллеспи, была показана на кинофестивале в Торонто и принесла режиссеру три номинации на премию «Оскар»® и столько же на премию «Золотой Глобус»®. Актриса Эллисон Дженни получила премию Американской Кино Академии и «Золотой Глобус»® как лучшая актриса второго плана. Фильма рассказывает о скандально известной американской фигуристке Тони Хардинг, которая из национальной гордости превращается в изгоя после того, как её публично обвинили в сговоре по устранению своей основной соперницы накануне Олимпиады 1994 года. 


В 2016 Крэйг Гиллеспи снял фильм «И грянул шторм» с участием Криса Пайна, Кейси Аффлека, Бена Фостера, Холлидей Грейнджер, Джона Ортиса и Эрика Баны.


В 2014 году Гиллеспи руководит съемками фильма для студии Disney под названием «Рука на миллион» с участием Джона Хэмма. Лента рассказывает историю появления первых индийцев в американском профессиональном бейсболе. В 2011 году Крэйг снимает ремейк «Ночи страха» с участием Антона Ельчина и Колина Фаррела. 

Картиной, на которой Крэйг Гиллеспи впервые выступил в качестве режиссера, стала созданная в 2007 комедия «Мистер Простофиля» с участием Билли Боба Торнтона, Шона Уильяма Скотта и Сьюзен Сарандон. В том же году он заставил о себе говорить после выхода фильма «Ларс и настоящая девушка» с участием Райана Гослинга. Газета Los Angeles Times назвала его работу «невероятным праздником неиссякаемого воображения». Нэнси Оливер была номинирована на премию «Оскар»® за лучший сценарий. 


Гиллеспи выступил режиссером и продюсером сериала «Такая разная Тара». Тони Коллетт, актриса, сыгравшая главную роль, была удостоена премий «Эми» и «Золотого Глобус». 


Также на счету Крэйга Гиллеспи многочисленные награды за съёмку рекламные ролики, включая «каннских львов» и «Эми».
