Марго Робби появилась на свет 3 июля 1990 года в австралийском городе Дэлби. Детство будущей кинозвезды прошло на ферме, где ее вместе с тремя братьями и сестрой воспитывала мать-одиночка. В юные годы Марго отнюдь не блистала красотой, носила очки и брекеты на зубах, но могла похвастать умением водить трактор и доить коров, что было куда актуальнее для её семьи. Втайне же девочка мечтала о кино. В школе Марго начала подрабатывать, чтобы собрать деньги на обучение актерскому мастерству: работала официанткой, помощником повара и даже уборщицей.
В 17 лет Робби переезжает в Мельбурн, где на самостоятельно заработанные деньги поступает на актерские курсы. В Мельбурне ей приходится несладко: она учится, бегает на бесконечные пробы и кастинги, зарабатывает себе на жизнь, продавая бутерброды в «Сабвее». По иронии судьбы, будучи уже узнаваемой актрисой в Австралии, именно Марго стала лицом рекламной компании сети «Сабвей».
Первой большой удачей в карьере для Робби стала роль в сериале «Соседи». Этот уже легендарный сериал идет в Австралии с 1985 года, и он стал первой ступенькой к успеху для многих, теперь уже сложившихся голливудских звезд: Рассела Кроу, Гая Пирса, Кайли Миноуг. Марго продержалась в сериале в роли бисексуалки Донны Фридман 3 года. За эту роль актриса получила 2 номинации престижной австралийской награды «Логги» (эквивалент американской премии «Эмми»).
Успех на родине не вскружил голову практичной австралийке, ей нужно было двигаться дальше. В 2011 году она переезжает в Лос-Анджелес, чтобы покорить Голливуд. Вскоре Марго получает роль в сериале «Пэн Американ». Участие в этом сериале приносит ей внимание серьезных киностудий. Марго приглашают в большое кино. В 2013 году она снимается в фильмах «Бойфренд из будущего» и «Волк с Уолл-Стрит», где воплощает свою детскую мечту – знакомится с Леонардо ДиКаприо. На пробах она просто поразила Скорсезе, когда настолько вошла в роль, что ударила ДиКаприо по лицу во время диалога. На долю Робби выпал десяток запоминающихся сцен, в том числе и провокационных. Дерзкий нрав очень пригодился Марго в съемках, позволив держаться уверенно и естественно, что вызвало закономерный интерес широкой публики к малоизвестной тогда австралийской диве. Фильм «Волк с Уолл-Стрит» ждала оглушительная слава, часть которой заслуженно перепала и Марго Робби.
Работа с Мартином Скорсезе стала переломным этапом в карьере актрисы. О Марго заговорили, ее фотографии начали появляться на обложках глянцевых журналов, а предложения сниматься стали поступать одно за другим. Робби исполняет главные роли в криминальной комедии «Фокус» (2015) с Уиллом Смитом, в очередной экранизации о Тарзане (2016), где её партнером стал Александр Скарсгард. В том же 2016-м Робби исполнила роль, которая на долгие годы стала её «визитной карточкой» - взбалмошной и сексапильной психопатки Харли Квинн, возлюбленной Джокера, заклятого врага Бэтмена. Марго в этом образе получилась невероятно притягательной, яркой и эксцентричной, став фактически лучшей частью провального в целом «Отряда самоубийц» (2016).
Громкая слава в среде поклонников мейнстримного кино и растущие гонорары не поколебали желания Марго Робби попробовать себя в драматических ролях. Честолюбивая австралийка мечтала завоевать «Оскар», справедливо полагая, что способна покорить публику не столько внешними данными, сколько артистизмом. Подходящий шанс выпал, когда Марго досталась роль фигуристки Тони Хардинг в биографической драме с элементами черной комедии «Тоня против всех» (2017). Для убедительного вхождения в образ Марго научилась кататься на коньках и разучила некоторые элементы в фигурном катании. Благодаря превосходной операторской работе складывалось впечатление, что Робби сама исполняет на льду сложнейшие трюки. Фильм «Тоня против всех» был успешен в прокате, заслужил признание критиков, а сама Марго была номинирована на «Оскар» и «Золотой глобус». И хоть взять эти награды ей было не суждено, а австралийская красавица доказала свой талант.
Серьезные роли Марго Робби чередовались с лёгкими, в каждом образе девушка смотрелась свежо и ярко, но фильмы как правило «не выстреливали». Так произошло с неонурным триллером «Конченая» (2018), с драмой «Страна грез» (2018) и исторической лентой «Две королевы» (2018). Стало понятно, что с развитием наметились определенные проблемы. Годом позже Марго приняла участие в двух громких премьерах – драмы «Скандал» и комедии «Однажды в Голливуде». В последнем фильме Робби отыграла Шерон Тейт, беременную жену знаменитого режиссера Романа Полански, чье жестокое убийство в конце 60-х потрясло США. Лента Квентина Тарантино представила альтернативный взгляд на исторические события, что позволило Марго слегка отойти от реальной личности.

Спустя ещё год, в 2020-м Робби возвращается к своему культовому образу Харли Квинн, получив главную роль в фильме-сольнике, посвященному этой героине. Картину «Хищные птицы: Потрясающая история Харли Квинн» ждал столь же холодный прием, что и «Отряд самоубийц», но сама Марго была по традиции эффектной, сексапильной и запоминающейся. Актриса вновь примерит одеяние сумасшедшей клоунессы для новой версии «Отряда самоубийц», на этот раз режиссуры Джеймса Ганна. 
Марго Робби продолжает оставаться одной из самых востребованных молодых актрис современности. Ее избранником в личной жизни стал помощник режиссера Том Акерли. Пара мечтает о рождении первенца.');
Уже в школе будущий актер начал участвовать в постановках различных пьес по мотивам классических произведений. Когда Себастьян учился в старших классах, он провел летние каникулы в театральном лагере «Stagedoor Manor». Там он был задействован в нескольких представлениях. И именно это и повлияло на его решение относительно выбора профессии.
Как только Себастьян окончил школу, он сразу же подал документы в несколько американских образовательных учреждений, где обучают актерскому мастерству. В результате он учился в Ратгерском университете в Нью-Джерси. Стэн получил степень бакалавра, а затем еще год стажировался в лондонском театре «Глобус». 
Окончив университет в 2005 году, он сразу же попал на съемки «Архитектора». В этом проекте он работал вместе с Изабеллой Росселлини и Энтони ЛаПалья. В 2006 году в прокате появился фильм «Сделка с дьяволом». Здесь Себастьян Стэн сыграл главного отрицательного персонажа. Его коллегой на съемках стал Чейз Кроуфорд.
В 2007 году Стэн приступил к съемкам в сериале «Сплетница». Там ему досталась роль Картера Бейзена. В этом же году он исполнил роль Лео в драме «Образование Чарли Бэнкса». 
В 2009 году телезрители увидели его в сериале «The Kings», а сам Себастьян продолжил сниматься в некоторых эпизодах «Сплетницы». Летом этого же года в свет вышел фильм «Бабник». Стэн сыграл роль лучшего друга главного героя (Эштон Катчер). Но наибольшую популярность актеру принесла роль Баки Барнса в 2 фильмах - «Первый мститель» и «Первый мститель: Другая война».
Себастьян Стэн снялся более чем в 30 фильмах. Самыми популярными работами стали картины «Политиканы», «Черный лебедь», «Лабиринт», «Марсианин», «Явление», «Красные двери», «Машина времени в джакузи», «Рэйчел выходит замуж», «Политические животные», «Игра на выживание» и другие.
В 2008 году Себастьян Стэн начал строить отношения со своей коллегой по сериалу «Сплетница» Лейтон Мистер. Однако спустя 2 года молодые люди расстались. После этого у актера был непродолжительный роман с Дианой Агрон, известной большинству телезрителей по сериалу «Хор». В мае 2012 года Стэн снова начал отношения с другой коллегой по съемочной площадке. На этот раз его сердце было отдано актрисе Дженнифер Моррисон, с которой Себастьян Стэн снялся в популярном телевизионном сериале «Однажды в сказке».
