Театральной аудитории Каннавале знаком по ролям в спектаклях «Продолжительность жизни факта», «Волосатая обезьяна» (номинация на премию Drama Desk), The Big Knife, «Гленгарри Глен Росс», The Motherf**ker With the Hat (номинации на премии Drama Desk и «Тони»), «Маврикий» (номинация на «Тони»), Hurlyburly, F--ing A и The Gingerbread House. 

