Когда девочке исполнилось 7 лет, она вместе с родителями переехала в Австралию. В детстве Бояна мечтала стать врачом или социальным работником, но после того как успешно выступила в школьных постановках, решила связать свою жизнь с актерской игрой. После окончания колледжа «МакДональд» в Сиднее Новакович поступила в Австралийский Национальный институт Драматических искусств, который в 2002 году с успехом окончила, ей была присвоена степень бакалавра в области драмы.
После завершения учебы Бояна начала свою актерскую карьеру, первые ее роли в кино были эпизодические, она появилась в таких сериалах, как «Большое небо», «Школа разбитых сердец», «Водяные крысы» и «Зов убийцы». Также она была задействована и в картинах австралийского производства, с ее участием вышли киноленты «Черная скала» и «Маска обезьяны». В 2003 году актриса работала над картиной «Marking Time» для канала ABC, за безупречно сыгранную роль Новакович была удостоена премии на Австралийском кинофестивале «Award AFI» в номинации «Лучшая женская роль». 
После такого успеха к Бояне пришла известность и популярность. Ей поступило приглашение на съемки в США, где она снялась в таких картинах, как «Возмездие», «Дьявол» и «Затащи меня в ад». Работа в данных кинолентах укрепила известность актрисы, она стала востребованной и узнаваемой. В 2004 году с ее участием вышла кинолента под названием «Сраженные наповал», в следующем году на экранах телевизоров появился фильм «Соло», в 2006 году зрители увидели актрису в картине «Оптимисты».
В период с 2007 по 2010 годы Бояна активно снималась в телесериале под названием «Наслаждение», также в это время на телеэкранах появились такие картины с участием Новакович, как «Затащи меня в ад» (2009), «Возмездие» (2010), «Дъявол» (2010). Среди ее работ имеются такие фильмы, как «Трое в Нью-Йорке» (2011), «Горящий человек» (2011) и «Помогите стать отцом» (2012).
Помимо работы в кино, Бояна также играет и на сцене театра. В Австралийском театре с ее участием вышли постановки под названием «These People» и «Away and Strange Fruit». В театре Мельбурна зрители увидели любимую актрису в пьесах «Necessary Targets», «Criminology» и «Woyzeck». Некоторые из этих работ были высоко оценены и принесли Новакович новые награды. 
Сейчас Бояна - успешная и востребованная актриса, она активно снимается в кино. Она работает над съемками картин «Burning Man» и «Тени от неба». В 2014 году актриса отлично исполнила главную женскую роль в картине «Рейк», а по окончании съемок сразу же получила предложение о ведущей роли в кинопроекте канала ABC «Агата».
Помимо съемок, актриса пробует себя в режиссуре, она владеет собственной театральной компанией под названием «Ride On Theatre», созданной в 2003 году. Успех как к режиссеру-постановщику пришел лишь в 2011 году, когда пьеса «Мэри Маклейн», написанная Бояной, имела ошеломительный успех у публики. Также Новакович работает сербским переводчиком для кино и театра.');


